INSERT INTO `events` (`event_id`, `cat_id`, `title`, `short_desc`, `details`, `min_memb`, `max_memb`, `venue`, `reg_fee`, `fee_type`, `prize`, `file1`, `file2`, `file_last_date`, `co1_name`, `co1_no`, `co2_name`, `co2_no`, `seats`, `reg_start`, `reg_end`, `username`, `pswd`, `link`, `is_certificate_pub`, `image_name`) VALUES
(1, 18, 'De novo', '\"In a world of innovation and creativity, words like crazy, weird and eccentric are compliments.\" - Michael Kouly', '﻿<p>Working on something crazy and innovative? Think these outlandish ideas can change the world? For all those brave and talented innovators out there, Hestia\'19 proudly presents \'Denovo\', a one-of-a-kind project presentation extravaganza.</p>\r\n\r\n<p>So be sure to grab this unique opportunity to pitch your creations against the best teams from across the country in a showdown of wits, where only the&nbsp; rem&eacute;-de-la-crem&eacute; will come out on top.</p>\r\n\r\n<p><strong>Rules and Regulations</strong>:</p>\r\n\r\n<ul>\r\n\r\n  <li>Maximum of five members per team.</li></li>\r\n\r\n<li> All deadlines must be strictly followed.</li>\r\n\r\n<li>The abstract should include the working principle of the project.</li>\r\n\r\n<li>Participants must submit a video of maximum two minutes, explaining the idea behind their project.</li>\r\n\r\n<li>All material requirements of the project should be met by the participants.</li>\r\n\r\n<li>Plagiarism of any manner will not be entertained.</li>\r\n\r\n<li>Decision of the judging panel will be final.</li>\r\n\r\n<li>The submitted projects will undergo a peer review process. The selected project groups will be invited to showcase their project along with working model during Hestia&rsquo;19. The best two projects will be awarded with attractive prizes and mentorship.</li>\r\n\r\n</ul>\r\n\r\n<p><strong>Judging Criteria</strong></p>\r\n\r\n<li> The project should be unique and original.</li>\r\n\r\n<li>External aid besides mentorship in meeting the project requirements and project accomplishments will be considered as a demerit.</li>\r\n\r\n<li>Adherence to the key elements- Concept, knowledge, skill, relevance,feasibility etc.</li>\r\n\r\n<li>Impact of the project on the society.</li>\r\n\r\n<li>USP of the idea used and the level to which it was implemented and displayed as a project.</li>\r\n\r\n</ul>', 1, 5, '', 1250, 'team', '75K', 'Link to Abstract (pdf)', 'Link to Video', '2019-03-26', 'Neethu E V', '9544695845', 'MA Abraham', '9947871688', 30, '2019-03-15 00:00:00', '2019-03-26 00:00:00', 'denovo', '$2y$13$L6.nhnKcY7h./ebYgWCdz.eBfn1Z7dTeWfuWDoh8.7PbhLa6kN51i', 'denovo', 1, ''),
(2, 9, 'Robo War', '\"Wage the war, with your machine, to build the future\"', '<p>Competitors bring their robots ready to battle and are pitted against their competitors\' robots in one-on-one knockout matches.The aim is to push the opponent\'s &nbsp;bot off the arena. First round winners will qualify for higher levels.</p>\r\n<p><strong>Rules and regulations</strong> :</p>\r\n<ul>\r\n<li>The size of the arena should be 2.5&times;2.5 m</li>\r\n<li>Dimensions of robot should be within 70&times;70&times;90 cm (tolerance of 10% on dimensions)</li>\r\n<li>The weight of the robot shouldn\'t exceed 25 Kg</li>\r\n<li>The bot can be wired or wireless. If wired length of wire shouldn\'t exceed 5m.</li>\r\n<li>There should be no entanglement of the wires during the match. If there happens to be one, a reset would be announced by the judge.</li>\r\n<li>The robot can have flippers &amp; lifting devices, cutters, etc.</li>\r\n<li>Use of weapons designed to cause invisible damage to other robot tesla coil, Van de graff generators, stun guns or similar devices are excluded.</li>\r\n<li>Flammable liquids, gases, explosives are also excluded.</li>\r\n<li>The mode of mobility can be rolling. Jumping, Hopping &amp; flying are not allowed.</li>\r\n<li>Max of 5 students per team. Spot registration will be available.</li>\r\n<li>In case of disputes, decision of the event in charge will be final</li>\r\n<li>Organisers possess the right to change the rules if necessary</li>\r\n<li>There should be minimum of 3 participants or else the event will be void</li>\r\n</ul>', 1, 5, 'Basketball court', 600, 'team', '30K', NULL, NULL, NULL, 'Athul Krishnan G', '9895067703', 'Sayuj Jayadev', '9400604321', 20, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'robo_war', '$2y$10$yBLMDlGgfNfNefBTy6ZmMulODq1QeMMINmQV0n.RliF0ZbdIXr1jq', 'robo_war', 1, ''),
(3, 9, 'Drone Dash', 'Tired of roads..?', '<p>The time has come to boost the motors in air &amp; conquer the circuit. HESTIA\'19 presents to you DRONE DASH to show your talents in aero modelling and drone racing.Make your drone the ultimate eagle of the sky..!!</p>\r\n<p><strong>Rules:</strong></p>\r\n<ul>\r\n<li>Maximum 4 members per team.</li>\r\n<li>The dimensions of the drone must not exceed 400mm*400mm*300mm.</li>\r\n<li>The drone must not be automated and must be controlled manually.</li>\r\n<li>Teams should bring their own remote controls that operate at 2.4GHz.</li>\r\n<li>Ready-made motors, remote control units, electronic speed controllers and propellers are allowed, although ready to use kits are strictly prohibited.</li>\r\n<li>FPV drones are preferred, though not compulsory.</li>\r\n<li>A maximum of 10mins will be given to complete the entire circuit.</li>\r\n<li>The event will be cancelled if there are not more than 3 participants.</li>\r\n</ul>\r\n<p><strong>Judging Criteria</strong></p>\r\n<ul>\r\n<li>The circuit will consist of obstacles and checkpoints. Reaching each checkpoint will earn you points.</li>\r\n<li>The drones are not allowed to land once the circuit has begun.</li>\r\n<li>Crash landing will force the drone to move back to the previous checkpoint.</li>\r\n<li>Teams that fail to cross an obstacle in 3 attempts will be forced to skip that segment.</li>\r\n<li>In addition to the points earned, the performance of each team will be timed. Shorter timings will earn the team higher points.</li>\r\n<li>In case of a tie, the cost effective design of the drone will be considered to determine the winner.</li>\r\n</ul>\r\n<p>So why wait?&nbsp; Beat the battle and be ready to have prizes worth 25k</p>', 1, 4, 'College Ground', 500, 'team', '25K', NULL, NULL, NULL, 'Nimya CP', '9495732554', 'Thomas Kuruvila', '9496800215', 20, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'drone_dash', '$2y$13$nmbPaueqP3FJB82jrAeoE.DOONipQYFMmKcdRscbkE7kVVSzj4djC', 'drone_dash', 1, ''),
(4, 10, 'Choreo Night', 'It\'s time to get your crew spirit at its peak, for the event of skills and expressions, moves and energy, emotions and coordination is back!', '<p>If you can foster a world of steps and rhythm and get everyone on their feet, if you have that impulsive electricity in your movements to drive your spectators in awe, then at Hestia \'19, the stage is already set for you!</p>\r\n<p>This summer, gear up for the ultimate dance battle! It\'s time to get your crew spirit at its peak, for the event of skills and expressions, moves and energy, emotions and coordination is back!</p>\r\n<p><strong>Rules and Regulations</strong>:</p>\r\n<ul>\r\n<li>A team may comprise of a minimum of 5 to a maximum of 25 members including backstage crew.</li>\r\n<li>The soundtrack in MP3 format must be submitted to the coordinators in a pen drive at least an hour prior to the event.</li>\r\n<li>Maximum time allotted for each performance is 12 minutes.</li>\r\n<li>Each participant must carry with them their college ID.</li>\r\n<li>The decision of the judges and the coordinators shall be final and binding.</li>\r\n<li>Properties, if any, should be arranged by the contestants themselves. If any special arrangements are required, the coordinators should be informed prior to the competition.&nbsp;</li>\r\n<li>Any kind of fluid, powder, flame or heavy object is not allowed on stage and will lead to direct disqualification of the team.</li>\r\n<li>Obscenity, vulgarity or any indecent display of any kind will entail immediate disqualification.</li>\r\n<li>Violation of any rules will lead to immediate disqualification.</li>\r\n<li>Failure to be present at the time of event leads to disqualification.</li>\r\n</ul>\r\n', 5, 25, 'Main Stage', 200, 'head', '100K', NULL, NULL, NULL, 'Amal Jyothi', '9495512675', 'Adhil Rasheed', '9496645408', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'choreo_night', '$2y$13$cuBNddjuxbPdDxqDRcb3oeIx6KJuU5E1enkmdtiD24aDVSXFhNrrS', 'choreo_night', 0, ''),
(5, 12, 'Encore', 'A chance to capture the essence of Rock Music for all you, rock fanatics!', '<p>Dominate the strings like Jimi Hendrix. Control the crowd like Chester Bennington.</p>\r\n<p>Its time to plug in your guitars and channel the inner rockstar in you. Feel the adrenaline flow through your veins as the crowd chants to the rhythm of your beat. Rock fanatics, here\'s your chance to capture the essence of greats like Linkin Park and Metallica! Hestia\'19, brings to you Encore, a rock band competition. Be there on the 31st of March and get ready to bang your heads and go wild.</p>\r\n<p><strong>Rules and Regulation:</strong></p>\r\n<ul>\r\n<li>Maximum of 10 members&nbsp; per team</li>\r\n<li>Time limit: 15 mins (+5 for setup)</li>\r\n<li>Genre can be any form of rock.</li>\r\n<li>Members of the team should be either from professional or arts colleges.</li>\r\n<li>Cross-college teams are allowed.</li>\r\n<li>A participant cannot be a part of more than one team.</li>\r\n<li>All music should be played live on stage and no pre-recorded music is allowed.</li>\r\n<li>Judges decision will be final.</li>\r\n<li>Original composition and crowd interaction have plus points.</li>\r\n</ul>', 1, 10, 'Auditorium', 1200, 'team', '40K', NULL, NULL, NULL, 'Nabeel Mohammed', '7560809248', 'Piyush', '8893017367', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'encore', '$2y$13$MV1n1Btx4k/ILZgyiCIMG.M6D6JOv3KJsQl7qNrtTKpXrX9CXqo0S', 'encore', 0, ''),
(6, 10, 'Beat The Beat', 'Sway. Split. Twirl. Do it all, for dance is the language of the soul. It’s time to go solo!', '<p>Dance, like wine, gets mature with every performance. Moreover, it is an expression of one\'s inner self. Set free the chained spirits and go solo this time. Bring out the best in you. Put your best foot forward. Dance to express at Hestia 19.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>This is an individual event.</li>\r\n<li>Each participant should bring their college ID card.</li>\r\n<li>Permitted dance forms are Hip Hop, Freestyle, B-boying, Bollywood and Contemporary.</li>\r\n<li>The soundtrack should be in Mp3 format and must be submitted an hour prior to the event in a CD or pen drive to the coordinator.</li>\r\n<li>Maximum time allotted is 7 minutes.</li>\r\n<li>The performance shall be evaluated based on choreography, presentation, rhythm, expressions and costume.</li>\r\n<li>Judges and coordinators decision shall be final and binding.</li>\r\n<li>Properties, if any, should be arranged by themselves if any special arrangements are required the coordinators should be informed prior to the competition.</li>\r\n<li>Fire, water, heavy objects and indecent behaviour or dressing can lead to disqualification.</li>\r\n</ul>', 1, 1, 'Mech Central Square', 150, 'head', '9K', NULL, NULL, NULL, 'Ann Philip', '9497095021', 'Yadu Rajasekhar', '9400563222', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'beat_the_beat', '$2y$13$tKx//pZkrihpkxXnxlR3v.km5WoThWe/Ur96MuHALaXOSqc0qr.Mm', 'beat_the_beat', 0, ''),
(7, 17, 'Incognito', 'It’s time to hunt them down, for the Pandora’s Box has opened again. It’s time to scrabble through the web for the tips and clues to unravel the hidden gold.', '<p>With questions and riddles yet to be untangled by the masterminds, Hestia &lsquo;19, the Techno-Cultural fest of TKM College of Engineering brings to you Incognito- the online treasure hunt competition.</p>\r\n<p>Website:&nbsp;<a href=\"https://incognito.hestia.live/\" target=\"_blank\" rel=\"noopener\" data-saferedirecturl=\"https://www.google.com/url?q=https://incognito.hestia.live&amp;source=gmail&amp;ust=1552478941006000&amp;usg=AFQjCNFqTp_DpKjvE-FH3krhDvv41fBwXw\">https://incognito.hestia.live</a></p>\r\n<p>Live Updates on :</p>\r\n<p>Instagram : <a href=\"https://www.instagram.com/incognito.hestia\" target=\"_blank\" rel=\"noopener\" data-saferedirecturl=\"https://www.google.com/url?q=https://www.instagram.com/incognito.hestia&amp;source=gmail&amp;ust=1552478941006000&amp;usg=AFQjCNHHjO-ZpF3n-oHVFQ3Vp2VgKYgeMw\">https://www.instagram.com/<wbr />incognito.hestia</a></p>\r\n<p>Facebook : <a href=\"https://www.facebook.com/incognito.hestia\" target=\"_blank\" rel=\"noopener\" data-saferedirecturl=\"https://www.google.com/url?q=https://www.facebook.com/incognito.hestia&amp;source=gmail&amp;ust=1552478941006000&amp;usg=AFQjCNEZQIUwkEfJppPo4ITpmdfx28akYg\">https://www.facebook.com/<wbr />incognito.hestia</a></p>\r\n<p>The event kick-starts at <strong>9 PM </strong>on the&nbsp;<strong>13th of March</strong>.</p>\r\n<p>Remember, when all seems lost, hope still remains!</p>\r\n<p><strong>The Rules :</strong></p>\r\n<ul>\r\n<li>This is an individual\'s game. Play it that way.</li>\r\n<li>Login using your Facebook ID to play. However, you may claim the prize only if you\'re a school/college student with a valid ID card.</li>\r\n<li>There will be separate tables for \'Home\' &amp; \'Away\' hunters.</li>\r\n<li>No spoilers please! Don\'t get yourself banned. Same goes for hackers.</li>\r\n<li>You may answer only in lowercase letters without spaces. No other special characters are to be used.</li>\r\n<li>Mention full names for anything you enter.</li>\r\n<li>You can find the hints for some levels in page source, file download, URL, cookies, Hestia&rsquo;19 website, Incognito facebook page, Instagram page, image names etc.</li>\r\n<li>You will complete a phase by making it through the 20 levels. There will be a total of 2 phases, spanning a week each.</li>\r\n<li>Google is your only friend.</li>\r\n<li>Prizes will be awarded for each phase separately.</li>\r\n<li>The admin has the &ldquo;All Seeing Eye&rdquo; in his backyard, so cheaters beware!</li>\r\n</ul>', 1, 1, '', NULL, NULL, '15K', NULL, NULL, NULL, 'Keerthi V', '8281992530', 'Akshay M', '7736791585', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'incognito', '$2y$10$b1fIoNnlFuAAXceNPOTDQeKm3/dapgH2DZuVmvZu14CoVyUfc8P2m', 'incognito', 0, ''),
(8, 12, 'Unplugged', 'It’s time to captivate the world with your melodious creations. The stage is set and the crowd is waiting, are you ready?', '<p>Turn up the volume, close your eyes and let the music take over your soul. Get yourselves immersed in some of the most blissful music ever created. Let your soothing voice shine through the crowd and the acoustic harmony resonate through you. It is time to come up on the stage and express the inexpressible through music. This summer, get yourselves Unplugged at Hestia\'19.</p>\r\n<p>Rules and Regulations:</p>\r\n<ul>\r\n<li>A minimum of two instruments should be played.</li>\r\n<li>Time:&nbsp;12 mins (+ 5mins for setup)</li>\r\n<li>A 5 piece standard drum kit will be provided.</li>\r\n<li>Members of the team should be either professional or arts college students.</li>\r\n<li>Cross-college teams are allowed.</li>\r\n<li>The guitar should be played with a clean tone. And for keyboard, only piano and pad patches should be used.</li>\r\n<li>Pre-recorded music is not permitted.</li>\r\n<li>A Participant cannot be part of two teams.</li>\r\n<li>Own composition has plus points.</li>\r\n<li>Judges decision will be final.</li>\r\n</ul>', 1, 10, 'Auditorium', 800, 'team', '25K', NULL, NULL, NULL, 'Viswanath', '9400627962', 'George', '9605003555', 10, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'unplugged', '$2y$13$ILI6ZVOlzNgOOQiapSmfQeLjaxVl.eTheUp6WYttWkCDe3v8yg1Qe', 'unplugged', 1, ''),
(9, 17, 'FSTOP', 'Online Photography Contest', '<p>“In black and white there are more colors than color photography, because you are not blocked by any colors so you can use your experiences, your knowledge, and your fantasy, to put colors into black and white.” – Anders Petersen</p>\r\n<p>HESTIA \'19 is organizing an Online Photography Contest, \' FSTOP \', open to all students irrespective of age and institution.</p>\r\n<p><strong>RULES AND REGULATIONS</strong></p>\r\n<ul>\r\n  <li>The theme of the contest is \'Monochrome\'. The snapshots captured for the concours as per the motif `Monochrome&rsquo; will be put through an arrant evaluation and the selected ones will be divulged on the instagram page</li>\r\n  <li>Submissions will not be accepted once the deadline lapses, which is \' 28th March, 2019 \'</li>\r\n  <li>Entries for the contest are to be sent to \' tpctkm@hestia.live \'. It must be uploaded by the contestants with the following details specified in the e-mail:<br />- Name of the contestant<br />- Name of the institution<br />- Contact details</li>\r\n  <li>The maximum size limit of the entry is 10 MB, and has to be in JPEG format.</li>\r\n  <li>The entry must be an authentic work of the contestant.</li>\r\n  <li>Only one entry will be allowed per person.</li>\r\n  <li>Only basic editing such as sharpening, contrast adjustment, or simple cropping will be allowed. Advanced editing used to create illusions, deceptions or manipulations and the adding and removing of significant elements within the frame is prohibited.</li>\r\n  <li>The images should not have any watermarks or caption on them.</li>\r\n  <li>On the submission of the image for the contest, the contestant will be regarded as having given permission to Hestia to use the photographs for publicity and other purposes in the form of broadcast, digital media or social networking without any fee payment.</li>\r\n  <li>The top 25 entries with the maximum number of likes on our instagram page will be forwarded to the final stage of judgement.</li>\r\n  <li>Judges\' decision will be final and will not be influenced in any way.</li>\r\n  <li>The winners will be awarded with prize money worth ₹4k.</li>\r\n  <li>If any contestant is found to violate any of the rules mentioned above, the organisers will have the ultimate right to disqualify them.</li>\r\n</ul>', 1, 1, '', NULL, NULL, '4K', NULL, NULL, NULL, 'Jerin ', '8111838803', 'Veenious', '9562780024', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'fstop', '$2y$13$e5IktJjwxkptLwPuwgNY1O3UZB0n56nfd6.LvbntFHahDGfUxOJtO', 'fstop', 0, ''),
(10, 11, 'Hraswa', '\"A film is never really good unless the camera is an eye in the head of a poet.\" - Orson Welles', '<p>In an era of Netflix and chill, there is a dearth of movies that engage both our senses and our emotions. Time has come for all you daring and visionary filmmakers out there, to bring your stories to the big screen. Join in on our pursuit of a ground-breaking saga that combines excellent cinematography and intimate storytelling about anything and everything imaginable; from the trivial to the sensational, the mundane to the fantastical. So send in your magnum opus and bring your midas touch to the silver screens of HESTIA \'19.</p>\r\n<p><strong>Rules and Regulations</strong></p>\r\n<ul>\r\n<li>Hraswa is an open-event. Entries are invited from all.</li>\r\n<li>The entries have to be original and released on or after January 1, 2018. Content copied from any external source shall lead to direct disqualification.</li>\r\n<li>There is no subject/theme for the competition in particular.</li>\r\n<li>The film cannot exceed a total of 30 minutes running time, (not including the title cards and the credits).</li>\r\n<li>Registration to the event is to be done through the website of the fest, &nbsp;<a href=\"https://www.hestia.live/\" target=\"_blank\" rel=\"noopener\" data-saferedirecturl=\"https://www.google.com/url?q=https://www.hestia.live/&amp;source=gmail&amp;ust=1552638037177000&amp;usg=AFQjCNFaSzwG_28aUc6WypYTNVKncD7tGQ\">https://www.hestia.live</a> and soon after, a confirmation mail will be sent.</li>\r\n<li>The link to the short film(YouTube) should be sent along with the payment receipt to <a href=\"mailto:fd.tkmce@gmail.com\" target=\"_blank\" rel=\"noopener\">fd.tkmce@gmail.com</a> or send it as a single DVD or pen drive to:<br /><br />The Coordinator,<br /> Hraswa Short Film Fest,<br /> #103, Sree Kuruthikaman Nagar,<br /> TKMC P.O., Karicode,<br /> Kollam, Kerala<br /> 691005<br /><br /></li>\r\n<li>Only the top seven entries, screened by the jury will be displayed during the date of the festival and the screening will be solely on the discretion of the jury.</li>\r\n<li>Entries may be in any language but suitable on-screen English subtitles must be furnished for all.</li>\r\n<li>The quality of the video should be of suitable format for screening it using a standard projector (720p at least).</li>\r\n<li>The entries should be submitted on or before 23rd March 2019.</li>\r\n<li>The top 7 short films will be intimated 2 days prior to the event, and they are required to submit a hard copy (pen drive) of the movie and be physically present during the event on 28th March, 2019.</li>\r\n<li>The decision of the Jury regarding the results of the competition will be final and binding.</li>\r\n<li>In case of any disputes, the decision of coordinators will be final and binding.</li>\r\n</ul>', 1, 1, '', 400, 'head', '35K', NULL, NULL, NULL, 'Arif', '7994121908', 'Abhishek', '7025078078', 0, '2019-03-15 00:00:00', '2019-03-25 00:00:00', 'hraswa', '$2y$13$KAzx0As0bTiTMqrUuqcmrOB79XUyZR1Qx1OzrOu4mZtq45Le9GT6i', 'hraswa', 0, ''),
(11, 9, 'Cut Me Not', 'Robots are considered to be the pinnacle of innovative ideas that have occurred to mankind.', '<p>Robots are considered to be the pinnacle of innovative ideas that have occurred to mankind. HESTIA &rsquo;19 presents CUT ME NOT, for it&rsquo;s time to design your bots and equip it to take on the various obstacles and labyrinths in the path ahead. Fire up your neurons, design, code and master the sophisticated line follower!</p>\r\n<p><br /><strong> Rules and Regulations</strong>:</p>\r\n<ul>\r\n<li>The event will be have two stages, prelims and finals.</li>\r\n<li>Bots with the best course time will be selected for the finals.</li>\r\n<li>The line follower can be based on any boards.</li>\r\n<li>The dimensions of the bot shall not exceed 30cm*30cm*30cm.</li>\r\n<li>Time will be allotted to each team to test the environment before the race on demand</li>\r\n<li>During the race, the handler is allowed only to change the battery packs.</li>\r\n<li>There will be various checkpoints throughout the track.</li>\r\n<li>Total strength of the team should not exceed a count of 5.</li>\r\n<li>The robots or components should not alter or destroy the tracks.</li>\r\n<li>If a line follower leaves the track, a penalty of two seconds will be added and the bot has to start from the previous checkpoints.</li>\r\n<li>No hardware changes are allowed between two stages</li>\r\n</ul>', 1, 5, '202', 300, 'team', '12K', NULL, NULL, NULL, 'Ambu A', '7736170552', 'Mufeeda T P', '9539152229', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'cut_me_not', '$2y$13$WgLXrN9Yi2JYnncKIO78zeEG8/XB3cVy1AyUXw38H5Furgp4jcCky', 'cut_me_not', 1, ''),
(12, 5, 'Mu Coder', 'Makerspaces around the world are looking to add coding and electronics to their maker\r\neducation programs,', '<p>Makerspaces around the world are looking to add coding and electronics to their maker education programs, and one of the best ways to do this is by integrating an Arduino board into makerspace projects and lessons. HESTIA \'19 presents you MU CODER - an Arduino based Microcontroller Coding competition for all the electronic geeks and Arduino enthusiasts out there.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n  <li> A team can have a maximum of 2 members.</li>\r\n  <li>Arduino kits will be provided.</li>\r\n  <li>One laptop per team is compulsory.</li>\r\n  <li>The competition will comprise of 3 rounds.</li>\r\n  <li>All three rounds will be elimination rounds.</li>\r\n  <li>The fastest coder will be selected for the successive round from the first two rounds.</li>\r\n</ul>\r\n<p><strong>Format:</strong></p>\r\n<ul>\r\n  <li> Round 1: Written test based on Arduino basics</li>\r\n  <li>Round 2: Programming skill round</li>\r\n  <li>Round 3: Hardware Assembly</li>\r\n</ul>', 1, 2, 'EC computer lab', 100, 'head', '8K', NULL, NULL, NULL, 'Akshaya Devi', '9207229192', 'Shravan S', '8129231663', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'mu_coder', '$2y$13$dThHKLCGSYV7eweGQIZUCeEjYuSnvp0IpxvYIwQxQbCAt2uNRXgZO', 'mu_coder', 1, ''),
(13, 5, 'Estella Hunt', 'The fascinating world of circuits is open, and here is the chance to discover the phase of your journey!', '<p>The fascinating world of circuits is open, and here is the chance to discover the phase of your journey! HESTIA \'19 brings to you ESTELLA HUNT, an event for the true wizards of circuits and components. Brace yourselves for three levels of quiz, debugging and designing as you battle it out with the best. Apply your brains in concepts of electronics, bring out the electronic nerd within you!</p>\r\n<p><strong>Event Layout</strong></p>\r\n<p>The event will be conducted in 3 rounds:</p>\r\n<ul>\r\n  \r\n\r\n  <li>Round 1 will be a written test, consisting of basic electronics and general aptitude questions.</li>\r\n  <li>Round 2 will be a circuit debugging competition, wherein faults in the circuit should be identified and rectified to get the correct output.</li>\r\n  <li>Round 3 will comprise of tasks to design circuits for a given problem statement and implement them in the most efficient way possible.</li>\r\n  <li>The team that finishes with the maximum cumulative score (sum of scores of all the three rounds) will be declared the winner.</li>\r\n  </ul>\r\n  \r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n  <li>Each team can have a minimum of two members and a maximum of three members.</li>\r\n  <li>All the rounds will be strictly time bound.</li>\r\n  <li>Use of mobile phones or any other electronic devices is not permitted unless mentioned by the event managers at the time of event.</li>\r\n  <li>The decision of the organizing panel is considered absolute in all matters.</li>\r\n  \r\n</ul>', 2, 3, 'Communication lab', 150, 'head', '15K', NULL, NULL, NULL, 'Akhil P', '9895277531', 'Sama Sulfikar', '9567121798', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'estella_hunt', '$2y$13$0KlYeQ562WtH17P.NZoYzu82eNmmyslbKXbvETzpv1WMf80zTzI7S', 'estella_hunt', 1, ''),
(14, 5, 'Matricks', 'For the true MATLAB wizards', '<p>Do simplifying the complexities of engineering and knowing the mind of circuits add energy to your brain? Are you a true MATLAB wizard? Then it&rsquo;s just for you, the electronicians, that MATRICKS is crafted! HESTIA &lsquo;19 presents MATRICKS, a MATLAB coding contest for all the aspiring programmers out there. Come, showcase your coding expertise and let it be known that you\'re the best.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a maximum of 3 participants.</li>\r\n<li>System will be provided at venue.</li>\r\n<li>Use of mobile phones or the internet is prohibited.</li>\r\n<li>Indecent behavior will lead to direct disqualification.</li>\r\n<li>The fastest coder will be the winner.</li>\r\n<li>The judges decision will be final.</li>\r\n</ul>', 1, 3, 'Computer Matlab', 150, 'head', '8K', NULL, NULL, NULL, 'Sreerag M S', '9446400716', 'Navya Ann', '9496536332', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'matricks', '$2y$13$cuPaKDg3sYjbXPglpYTP2OgIaKrhpJh6frtDjs.Z3yOWzg4tQ30ky', 'matricks', 1, ''),
(15, 5, 'Tech Jam', 'Can you make it through sixty seconds of non-stop talking without hesitation, \r\n repetition, or deviation?', '<p>Can you make it through sixty seconds of non-stop talking without hesitation, repetition, or deviation? Or will the sheer pressure make you crumble and have your competitors pounce on you in an instant? TECH JAM is a technical event that is all about the control of the mind over the mouth! The pace at which technology impacts our lives accelerates every day, and stages like TECH JAM are needed to harness new ideas and inspire people to continue to innovate.So fret not, be a part of it and enhance your technical thinking and speaking as well!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>The event is open for all students.</li>\r\n<li>The event shall span a duration of 2 hours approximately.</li>\r\n<li>The participants will have to register individually.</li>\r\n<li>The participants will be given a topic, followed by a brief description.</li>\r\n  <li>Each participant will be given one minute to think and brainstorm, and one minute to speak.</li>\r\n  <li>The top 5 will qualify to the second round where scenarios will be given, and the participants are expected to speak for a minute.</li>\r\n</ul>', 1, 1, 'M413', 100, 'head', '5K', NULL, NULL, NULL, 'Sreelakshmy Suresh', '9496014408', 'Amal R Nadh', '8281612793', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'tech_jam', '$2y$13$KsSRErxVbB2opSplzDUpMeuol10i.o1cXy5mUPNxg5L8/A73UojQO', 'tech_jam', 1, ''),
(16, 7, 'Engine Assembly', '\"Take some time to spin the Otto Engines inside your brain\"', '<p>Engines are the heart of any vehicle.The injection of fuel, the stroke of the pistons, the rotation of the crankshaft, all of these make the heart pump and make the vehicle come to life. Engineers live to build the best hearts out there to stand apart with their vehicles. Be a class of your own this Hestia &rsquo;19 and assemble your own engine through various challenges and come out on top!</p>\r\n<p>Hestia &lsquo;19 brings to all those automotives out there, a perfect arena to prove your real elegance. All you have to do is put together all those parts into a real living engine. Advance to this final test, after you prove your basic aptitudes and the craftsmanship of your hands on simple components.Identify, oordinate,assemble,give it some power- it\'s just that simple!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a maximum of 3 members.</li>\r\n<li>The event will consist of three elimination rounds.</li>\r\n<li>The first round will be a basic aptitude test, out of which the top six teams will be shortlisted for the second round.</li>\r\n<li>In the second round, the teams are expected to assemble a simple mechanical component.</li>\r\n<li>In the final round, the teams would have to assemble a given automobile engine in limited time.</li>\r\n<li>Prizes will be awarded based on the third round.</li>\r\n<li>All the tools for the event will be provided by the coordinates. However, participants are allowed to bring their own tools.</li>\r\n<li>The event would be void unless there is a minimum of four registered teams.</li>\r\n<li>The decision of the event managers will be final and binding.</li>\r\n</ul>', 1, 3, 'Workshop Block', 150, 'team', '6K', NULL, NULL, NULL, 'Alin Amrulla', '7356546121', 'Amith Alexander', '9656466483', 0, '2019-03-15 00:00:00', '2019-03-29 23:59:00', 'engine_assembly', '$2y$13$gNaqpci1dTNzkGgtMoRxj.XxxVckMs2eh0CjR1ezoGRpy4KZSW2bq', 'engine_assembly', 1, ''),
(17, 7, 'Junkyard War', 'Engineering is all about putting concepts to practice and developing them in the real world.', '<p>Engineering is all about putting concepts to practice and developing them in the real world. Textbooks and lectures do help, to kickstart the grey matter in order to apply them. Junkyard wars is your opportunity to show how much of an engineer you are on the field. This is the opportunity of a lifetime to find the engineer in you and win it all!</p>\r\n<p><strong>Event Layout:</strong></p>\r\n<p>The event consists of three rounds:</p>\r\n<ul>\r\n<li>The first round will consist of a preliminary written test, comprising of an array of objective and descriptive questions on common engineering mechanisms, machines and common problems in the day to day life. Top 6 teams from this round will advance to the next round.</li>\r\n<li>The second round would contain a task, which would be given at the event venue. The teams will then have to complete the task within the stipulated time. The task involves the application of creative and technical skills.</li>\r\n<li>In the final round, a problem statement will be given and the teams are expected to design a mechanism using the materials provided by the event managers. The materials will have a certain cost which can be bought using the virtual money. The amount of virtual money gained would depend upon the scores obtained at the end of the first and second round.</li>\r\n</ul>\r\n<p>Scores would be awarded in each round, and the final score will be based on factors like the overall design, innovation and performance.</p>', 2, 3, 'Workshop block/Ground', 250, 'team', '15K', NULL, NULL, NULL, 'Asish Damodaran', '8281925106', 'Jishnu Nair', '8593843901', 0, '2019-03-15 00:00:00', '2019-03-29 23:59:00', 'junkyard_war', '$2y$13$0q2YJNZuasVdDXcB0sfHQug5O32C47Hw/KlASzaFU.9lW4cfmBTTO', 'junkyard_war', 1, ''),
(18, 3, 'Aquastrike', 'Every action has an equal and opposite reaction.', '<p>Every action has an equal and opposite reaction. And when water does it\'s part of action perfectly, it&rsquo;s always a treat. If aquarockets have always been a fascination to you, Hestia &lsquo;19 has the best launchpad for you. Come, ride, to infinity and beyond!</p>\r\n<p>Rules and Regulations:</p>\r\n<ul>\r\n<li>Each team can have a maximum of 3 participants and a minimum of one.</li>\r\n<li>Teams should produce a valid institute ID card.</li>\r\n<li>Points will be awarded based on the maximum distance covered and accuracy.</li>\r\n<li>Maximum allowed capacity is 2 litre.</li>\r\n<li>Maximum allowed pressure is 50 psi.</li>\r\n<li>The teams should attach a pressure gauge on the launcher itself.</li>\r\n<li>Maximum number of attempts per team in each round is restricted to 3 and best of 3 will be chosen for evaluation.</li>\r\n<li>Design aspects of the rocket will also be considered for evaluation.</li>\r\n</ul>', 1, 3, 'College ground', 150, 'team', '6K', NULL, NULL, NULL, 'Ashraf N', '7558959493', 'Rishi Wilson', '8547111893', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'aquastrike', '$2y$10$Lq2WaU30kXjRiZ9OzlBPL.IMB8ofCCME2m8ltyyku3DClPTSFEuZm', 'aquastrike', 1, ''),
(19, 7, 'Mr. Mechanical', 'Mr. Mechanical, a competition to find the king amongst the royals.', '<p>The Royals. The Machine Fanatics. The College Favourites. Such handles are associated with the Mechanical Engineering students of most colleges. It&rsquo;s time to find the king of the Mechanical Engineers, at this Hestia&rsquo; 19. Which among you is worthy of the title of Mr. Mechanical? Prove your mettle against the machine heads and go home with the bragging rights as the ultimate mechanical engineer and the one and only Mr.Mechanical of Hestia &rsquo;19!</p>\r\n<p><strong>Event Layout</strong></p>\r\n<ul>\r\n<li>Preliminary Round: A preliminary test will be conducted to shortlist the best candidates. This will test your technical knowledge about various mechanical engineering aspects.</li>\r\n<li>Round 1: Selected candidates would then be asked to design a geometrical model in AutoCAD in a stipulated time.</li>\r\n<li>Round 2: The second round would contain two workshop rounds:</li>\r\n<ol>\r\n<li>Lathe Test where you have to fine turn the given workpiece.</li>\r\n<li>Weld test where you have to weld a V Joint.</li>\r\n</ol>\r\n<li>Round 3: The final round would be a personality round.</li>\r\n</ul>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>This is an individual event.</li>\r\n<li>Shoes are mandatory during workshop events.</li>\r\n<li>Usage any of electronic devices such as mobile phones is not allowed.</li>\r\n<li>More than one students can participate from the same college.</li>\r\n<li>No consideration will give after the time limit expires.</li>\r\n<li>Final decision will be taken by the coordinators.</li>\r\n<li>Candidates will be disqualified at the spot if found doing any malpractices.</li>\r\n<li>Participants are requested to maintain communication with the coordinators.</li>\r\n<li>The event would be void unless there is a minimum of 4 participants.</li>\r\n<li>Rules may change with/without prior notice.</li>\r\n<li>Participants should have experience in handling the lathe and welding machine. They should also know how to use AutoCAD software for modelling.</li>\r\n</ul>', 1, 1, 'Workshop Block', 150, 'head', '10K', NULL, NULL, NULL, 'Elias Kurien', '7558066840', 'Melvin Sebastian', '8281789643', 0, '2019-03-15 00:00:00', '2019-03-30 23:59:00', 'mr_mechanical', '$2y$13$fC9bYvLHlCxno4zP.NQMmOWD3cKnI6yBxWhwTZelYY6u5zUZl7/im', 'mr_mechanical', 1, ''),
(20, 3, 'Affiche', 'The future is set for the thinkers, researchers and innovators.', '<p>The future is set for the thinkers, researchers and innovators. Affiche is crafted to bring out your versatility as a researcher, for the future is here. Raasa, at Hestia &lsquo;19, brings to you Affiche, a poster presentation competition to unravel the best of your professionalism and presentation skills. Design a poster on your research work and send in the abstracts to be reviewed by our experts. The selected posters can be presented at Hestia &lsquo;19, it&rsquo;s your turn to showcase the technical ingenuity in you.</p>\r\n<p><strong>Poster Format:</strong></p>\r\n<ul>\r\n<ul>\r\n<li>TITLE\r\n<p>The title should be the same as in the submitted abstract, and should be included at the top of the poster. The characters should be a minimum of 48 point font size. The participant&rsquo;s name, and college or centre should also be displayed on the poster. A font size of 48 to 60 point is recommended for headings.</p>\r\n</li>\r\n<li>SIZE\r\n<p>The poster must be of A0 size (841mm x 1189mm) in portrait orientation.</p>\r\n</li>\r\n<li>LETTERING\r\n<p>The poster should be easily readable from a distance of two meters. The use of standard upper and lower case is preferred for general content for readability. Avoid using a mixture of type/font styles.</p>\r\n</li>\r\n<li>CONTENT\r\n<p>A font size of 24 to 32, single spaced is recommended for the content. It will be best if all details in the poster contains is clear and understandable without any oral explanation. Results should be in line with those submitted in the abstract. The use of pictures, symbols and colour is encouraged. Figure legends are essential and should be short but informative. Graphs should have a short heading, if they are used. Graphs should not be smaller than 12cm x 18cm and photographs should not be smaller than 12cm x 18cm.</p>\r\n</li>\r\n</ul>\r\n</ul>\r\n<p>Note that flex printed poster should be carried for presentation and no printing provision will be provided at the venue.</p>\r\n<p><strong>Team Specifications:</strong></p>\r\n<ul>\r\n<li>Each group can have a maximum of four participants.</li>\r\n<li>Group members will have to produce a valid ID card of their institute.</li>\r\n</ul>\r\n<h3><a href=\"../assets/uploads/files/20.pdf\">Selected Abstracts</a></h3>', 1, 1, 'EEE Seminar Hall', 300, 'team', '12K', NULL, NULL, '2019-03-27', 'Sruthy C Nair', '8129273121', 'Muhammad Salih', '9207616460', 0, '2019-03-24 00:00:00', '2019-03-28 00:00:00', 'affiche', '$2y$13$/GdV6o9lGAvG5NzBmTwy3.krLMDf2U7bPVhzeFh7Oti4sOqn9JZo2', 'affiche', 1, ''),
(21, 3, 'INQUISITIVE', 'A quiz competition to explore and elicit the masterbrains in chemical engineering who have unquenchable thirst for amassing knowledge in chemical technology', '<p>Are you bored of long and lengthy scribblings in your answer sheets? Well then, we&rsquo;re here to set things short and sweet. At Hestia &lsquo;19, we are hosting a general quiz competition with a chemical touch, for all the quiz enthusiasts out there. Dig up and put on your thinking caps, because this quiz has all the elements that will make your gray matter churn. For, if you are not a part of the solution then you are a part of the precipitate.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a maximum of 3 and a minimum of 2 members.</li>\r\n<li>All participants are required to produce valid student ID cards.</li>\r\n<li>There will be two rounds, a prelims and a finals.</li>\r\n<li>Usage of mobile phones and other electronic gadgets are prohibited.</li>\r\n<li>All decisions of the quiz master will be final.</li>\r\n</ul>', 2, 3, '205', 150, 'team', '8K', NULL, NULL, NULL, 'Anaswara', '9496407905', 'Helna', '9207075047', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'inquisitive', '$2y$13$MWZ/Fhg7yRL8ttMhoX51s.28v0fzkHZM1SkhZqr0Y0Xwkzoz.3PYG', 'inquisitive', 1, ''),
(22, 3, 'Synectics', 'Synectics is an industrial problem solving platform to unveil your chemical engineering knowledge and insight.', '<p>To all curious provocative heads, Hestia &lsquo;19, presents you an opportunity to take up your skills far beyond a sheet of paper. Prove your worth as a fine chemical engineer, finding ideas for solutions to real industrial problems, while being judged by the best in the business. Because as Albert Einstein said, &lsquo;we are boxed in by the boundary conditions of our thinking&rsquo;.</p>\n\n<p><strong>Event Layout</strong></p>\n\n<p>The problem statements from 2 different companies will be available on the registration website, each in a PDF file and you are free to select any one problem and present its solution at the day of the event. The presentation will be judged by a panel of industrial experts.</p>\n\n<p><strong>Questions</strong></p>\n\n<p><a href=\"../assets/uploads/files/60_1.pdf\">Problem Statement 1</a></p>\n\n<p><a href=\"../assets/uploads/files/60_2.pdf\">Problem Statement 2</a></p>\n\n<strong>Rules &amp; Regulations</strong>\n\n  <ul>\n\n    <li>Participating teams must consist of minimum 2 and maximum 3 members.</li>\n\n    <li>Only one problem statement should be chosen for problem solving.</li>\n\n    <li>Participants will get a maximum of 10 minutes for elaborating the entire solution (including any questions from judges to clarify any point ) </li>\n\n    <li>Decision of the judges shall be treated as final and binding.</li>\n\n    <li>In case of any disputes, decision of coordinators will be final and binding.</li>\n\n</ul>\n\n\n', 2, 3, '209', 200, 'team', '10K', NULL, NULL, NULL, 'Meenakshi Priyadarsini', '8281291704', 'Arif Nisad', '7994121908', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'synectics', '$2y$10$X0Lx4pao3ZUJ8iX2ZbiJ2uXguCzsfKpp3C1gEUYQePRVo7OBwHcdq', 'synectics', 1, ''),
(23, 3, 'Formula-H', 'Passionate about racing?', '<p>Have what it takes to overcome the obstacles using chemical reactions? Well, then unleash the chemist in you. Design a self propelled vehicle that runs on chemical reaction, drive through the obstacles, beat the best and emerge the fastest!</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>A team can consist of a maximum of 3 members.</li>\r\n<li>The car must only be fueled by a chemical reaction. Use of combustion, batteries and physical mechanisms are not permitted.</li>\r\n<li>Use of hazardous chemicals are strictly forbidden.</li>\r\n<li>The dimensions of the car must not exceed 30x30x20cm.</li>\r\n<li>Explosion or detachment of parts during event will result in deduction of points.</li>\r\n<li>Ready made kits like lego are not allowed.</li>\r\n<li>The event will consist of 3 rounds, the maximum distance round, accuracy round and the shortest time round.</li>\r\n<li>Decision of the coordinators will be final.</li>\r\n</ul>', 1, 3, 'BasketBall Court', 150, 'team', '6K', NULL, NULL, NULL, 'Arunjith', '9656341959', 'John Kurian', '8281144542', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'formula_h', '$2y$13$PxiMb6km2il2t2hnf6DmxO60GFsO5tXkE1w7H2oVkoOPzXS1YJGya', 'formula_h', 1, ''),
(24, 3, 'Deadlock', 'Seeking chemical enthusiasts with sharpened minds to solve the mystery and quench the thirst for treasures.', '<p>\"Accept the challenge so that you can feel the exhilaration of victory.\"</p>\r\n<p>Can you be Google? A pirate seeking lost treasures? A Sherlock solving mysteries? If yes, the that&rsquo;s all it takes to emerge as the winner. HESTIA \'19 brings to you Deadlock, the perfect triad of questionnaire, treasure hunt and crime scene investigation. A team having proficiency with observation, logical reasoning and detective abilities together can cross the quizzing destination to hunt for the treasures and finally solve the mystery of the crime scene. You need to master it all!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>A team can comprise of a maximum of 3 members.</li>\r\n<li>The use of electronic gadgets like mobile phones, calculators, laptops, etc are prohibited.</li>\r\n<li>The event will consist of three rounds:</li>\r\n<ol>\r\n<li>Round 1: Questionnaire: Each team shall go through a written test to test their mental aptitude and basic engineering knowledge.</li>\r\n<li>Round 2: Treasure Hunt: Catch up your clues as you cross every level with perfect answers to the inquests.</li>\r\n<li>Round 3: Crime Scene Investigation: The top four teams will have to investigate about a crime scene and find the culprit and the motive behind the same. The solution, path of investigation and the speed counts here.</li>\r\n</ol>\r\n</ol>\r\n<li>There shall be an elimination of teams after every round.</li>\r\n  <li>The decision of judges and coordinators will be final and binding.</li>\r\n</ul>', 1, 3, '206', 200, 'team', '8K', NULL, NULL, NULL, 'Roshan', '9447619987', 'Afnas', '9037214463', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'deadlock', '$2y$13$61Kf.Axe8qekNPR0keg0aOEW14ZWj80dIhjZMb..iXUxpxSLRgPQ6', 'deadlock', 1, ''),
(25, 9, 'Accelero-Race', 'Time is ticking,race your bot to finish the line following your hand gestures and be the winner.', '<p>Combine your coding,control and coordination to be the first .Hestia&rsquo; 19 gives a golden opportunity to all robotic fanatics to prove their bot is the best of best.</p>\r\n<p><strong>Rules and regulations</strong></p>\r\n<ul>\r\n<li>Each team can have a maximum of 4 members.</span></li>\r\n<li>Team members should produce their college Id.</span></li>\r\n<li>Cross college teams are allowed.</li>\r\n<li>Teams are required to finish the race in minimum possible time.</li>\r\n<li>Vehicle should run only through the specified path.</li>\r\n<li>Maximum dimension allowed for the bot is 20cm&times;20cm&times;12cm also, the bot should be no smaller than 6cm&times;5cm&times;2cm.</li>\r\n<li>The decision made by the program head will be final. Any violation of these rules will result in disqualification of the team.</li>\r\n</ul>', 1, 4, '', 250, 'team', '8K', NULL, NULL, NULL, 'Fayis T', '7736866127', 'Asif Ali', '8129626830', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'accelero_race', '$2y$13$qIQ7ICwbGBIjdmHWGvNpO.O1Hv5Pl.uOKxVHaLGqvxUHxgs71KRcq', 'accelero_race', 1, ''),
(26, 9, 'VR Trailblazer', 'VR Trailblazer is a VR based wireless bot race', '<p>VR Trailblazer is a VR based wireless bot race where participants have to bring their bluetooth/radio controlled bot on which a phone will be mounted. VR perspective of the track will be mirrored to the participants\' phone. Viewing this VR view, participants will have to drive the bot through a fun-filled adventurous track.</p>\r\n<p><strong>Rules:</strong></p>\r\n<ul>\r\n<li>Length and breadth of the vehicle should be 20*20 cm or less.</li>\r\n<li>Enough space should be left free on the bot to attach mobile phones.</li>\r\n<li>Teams will not be allowed to charge their bots, once their bot starts to compete in the track.</li>\r\n<li>The number of participants in a team is limited to 4.</li>\r\n<li>No items should be ready made or of lego.</li>\r\n<li>Participants must report on time.</li>\r\n<li>The decision by the program heads will be final.</li>\r\n</ul>\r\n', 1, 4, 'Microprocessor Lab', 250, 'team', '10K', NULL, NULL, NULL, 'Irene Tenison', '7560844210', 'Jithin J', '9061316416', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'vr_trail', '$2y$13$w8EJP.aN/oiQGD9zpLh3x.EalHpAB8nxAvKj5XPKynoIeQZIOL4gK', 'vr_trailblazer', 1, ''),
(27, 8, 'Hexcod', 'Ready to get into the maze of code', '<p>HEXCOD is for the people out there who are up to brainstorm, think through each line and code. Clear the prelims composed of an ultimate technical quiz showdown to get to the finals, where the teams are taken through six levels of consisting of mind boggling tasks.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a maximum of two participants.</li>\r\n<li>The event will consist of two rounds.</li>\r\n<li>Use of internet or any other references are not allowed.</li>\r\n<li>Use of any electronic devices such as mobile phones are prohibited.</li>\r\n<li>No consideration will give once the time limit expires.</li>\r\n<li>The decision of the coordinators and the judging committee will be the final.</li>\r\n<li>Participants should have basic knowledge in C/C++.</li>\r\n</ul>', 2, 2, 'MCA Lab', 150, 'team', '8K', NULL, NULL, NULL, 'Aswinjith', '9539669102', 'Snigda', '7025820644', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'hexcod', '$2y$13$c5d.lwLdniUVXOsd1OtG8e.j37E4rEu0jTvI1ytchqtvQ2fVgsgFm', 'hexcod', 1, '');
INSERT INTO `events` (`event_id`, `cat_id`, `title`, `short_desc`, `details`, `min_memb`, `max_memb`, `venue`, `reg_fee`, `fee_type`, `prize`, `file1`, `file2`, `file_last_date`, `co1_name`, `co1_no`, `co2_name`, `co2_no`, `seats`, `reg_start`, `reg_end`, `username`, `pswd`, `link`, `is_certificate_pub`, `image_name`) VALUES
(28, 8, 'Hello World', 'Reveal the Blackbox', '<p>If you&rsquo;re proficient in decoding the logic behind the given sets of inputs and outputs within the given duration of time, come let&rsquo;s break the rule of coding. What if you are at the conclusion and need to get to the start? In HELLO WORLD, input &ndash; output pairs will be provided in the question, and you must find the link between the input and output in order to find the way to the solution.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>This is an individual event.</li>\r\n<li>The event will consist of two rounds &ndash; prelims and final.</li>\r\n<li>In the prelims, participants will have to answer a written test comprising of questions on logic, basic programming concepts, pattern recognition and program analysis. Participants will be shortlisted for the final round based on their performance in the written test.</li>\r\n<li>In the final round, participants are expected to decode the logic behind the given set of inputs and outputs,using &nbsp;any programming language.</li>\r\n<li>The participants must write and test their program on the allotted machine within the contest room.</li>\r\n<li>All the participants will be given the same set of problems to solve.</li>\r\n<li>Participants are not allowed to seek hints or any kinds of leads during the contest.</li>\r\n<li>Use of the internet mobile phones , electronic gadgets and references are prohibited.</li>\r\n<li>Participants will be judged based on their accuracy and efficiency.</li>\r\n<li>Finalised rules will be disclosed only five minutes before the event.</li>\r\n<li>The decision of the coordinators and the judging committee will be the final.</li>\r\n</ul>', 1, 1, 'MCA Lab', 100, 'head', '6K', NULL, NULL, NULL, 'Gokul P K', '9447087660 ', 'Akza John', '8129508995', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'hello_world', '$2y$13$MDhF.JP5id.WZYKBxy7L2u4Iy4c9zcIEfeBGp7ry5yYCbAzF.2yGi', 'hello_world', 1, ''),
(29, 8, 'Excavar', 'The blind code expert', '<p>Dig in and make your insights do the job. EXCAVAR is for the people who are confident enough to code without looking into the screen. In this two round event, each participant has to code a runnable program on the given scenario within the given duration, provided that the MONITOR WILL BE SWITCHED OFF. The contestants will be given a simple code with syntax errors which have to be turned into an executable program in the prelims, whereas in the finals, shortlisted contestants will have to solve a given problem statement and code it blindly.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>This is an individual event.</li>\r\n<li>Participants are allowed to use only a single computer and must write, code and test their program in that machine within the event room.</li>\r\n<li>Participants are not allowed to seek hints, suggestions or any kind of leads from others during the competition.</li>\r\n<li>Languages used will be C for prelims and C/C++ /JAVA for finals.</li>\r\n<li>The decision of the coordinators or the judging committee will be the final.</li>\r\n<li>Use of the internet, mobile phones or any references is prohibited.</li>\r\n<li>No consideration will be given once the time limit expires.</li>\r\n<li>Finalised rules will be disclosed only five minutes before the event.</li>\r\n</ul>', 1, 1, 'MCA Lab', 100, 'head', '6K', NULL, NULL, NULL, 'Nandu', '9072214633 ', 'Praseeda', '7022087871', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'excavar', '$2y$13$97ImrOcr2SpHH8wL79sRAeGGYFmjhnS9bpHkMm.XbgXM5NlqFbbtG', 'excavar', 1, ''),
(30, 17, 'Epoch', '“Our intelligence is what makes us human, and AI is an extension of that quality.” - Yann LeCun', '<p>From the advent of this century, we humans have bore witness to the rise of intelligent machines. Artificial Intelligence has touched every aspect of human life from intelligent conversational interfaces that mimic human speech to diagnosis of diseases that threaten human lives.</p>\r\n<p>In Epoch, the challenge is to utilize the power of AI to solve a socially relevant problem. The competition will be held online with a duration of two days. The problem statement and associated dataset will be provided at the beginning of the competition. Contest URL and Slack group invite link will be provided to the participants through Email .The contest URL will be sent only on the day of the competition. Participants may use any tool of their choice to solve the problem in the best way possible.</p>\r\n<p><br /><strong>RULES &amp; REGULATIONS</strong>:</p>\r\n<ul>\r\n<li>Particiants are allowed to form teams and each team can have a maximum of 2 members. Each participant can join only one team and each team will have a single account.</li>\r\n<li>Plagarism won&rsquo;t be tolerated. If caught, will amount to disqualification of the team.</li>\r\n<li>Any model, any tool can be used to solve the problem.</li>\r\n<li>Evaluation metric is Accuracy Score.</li>\r\n<li>Uploading code along with solution is compulsory.</li>\r\n<li>Slack Group will be created for discussions. Sharing of code among participants is prohibited in the group or elsewhere.</li>\r\n<li>Participants must share links of external datasets (if used) for the contest in the Slack group mentioned above.</li>\r\n<li>A team can make a maximum of 20 Submissions per Day</li>\r\n<li>A team can select only 1 final submission for judging.</li>\r\n</ul>', 1, 2, '', 100, 'team', '10K', NULL, NULL, NULL, 'Abin Shoby', '9496402096', 'Shaun Thayil', '8593815355', 0, '2019-03-15 00:00:00', '2019-03-24 00:00:00', 'epoch', '$2y$10$5R2awPbS1tWaX7TwUiWEpOILf2WIFAicR1M9CsVxQCZBeGtaN5NLq', 'epoch', 1, ''),
(31, 10, 'Dab2dmix', 'The cue music is on, if improv is your forte then show us why you are better than the best.', '<p>If choreography and creativity are your matrix; let\'s see where you can move. Make every new instant choreography a period of your adaptation.</p>\r\n<p>Hestia \'19 welcomes you to the spot dancing competition DAB2DMIX.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>The participant must be a college student and should submit the college ID card.</li>\r\n<li>Registration must be done beforehand.</li>\r\n<li>Performance duration is 1.5 minutes.</li>\r\n<li>The songs will be provided by the organising committee. &nbsp;&nbsp;&nbsp;</li>\r\n<li>Usage of dangerous properties to aid the performance is not entertained.</li>\r\n<li>Performance must not be morally ambiguous.</li>\r\n<li>No vulgar practises will be entertained.</li>\r\n<li>Any form of dance can be choreographed instantly on stage.</li>\r\n<li>The decision of the judges will be final.</li>\r\n</ul>', 1, 1, 'APJ Park', 150, 'head', '7K', NULL, NULL, NULL, 'Aswathy J K', '9474286659', 'Dileep', '7356242956', 0, '2019-03-16 00:00:00', '2019-03-28 00:00:00', 'dab2dmix', '$2y$13$t8mjMtrr.lFxJ9KU6dlqeeJ63QwqpkPGpn4fN57vElZJuHytlvbEK', 'dab2dmix', 0, ''),
(32, 10, 'Double Trouble', 'Witness the unison of two souls in perfect harmony as Hestia presents Double Trouble', '<p>Witness the unison of two souls in perfect harmony as Hestia presents Double Trouble, the perfect stage for you and your partner to showcase your telepathic co-ordination. So step up your game in this ultimate test of precise choreography and intimate understanding, as you ditto every stride and every emotion of one another, all the while obscured by an impenetrable screen.</p>\r\n<p>Rules and regulations:</p>\r\n<ul>\r\n<li>There should be two members per team and both the members should bring their college ID card.</li>\r\n<li>The team can be pair of any combination (boy &amp; boy / girl &amp; boy / girl &amp; girl).</li>\r\n<li>Cross college teams are not allowed.</li>\r\n<li>A non-transparent screen will be used to separate the participants.</li>\r\n<li>Maximum time allotted is 6 minutes.</li>\r\n<li>Props are allowed.</li>\r\n<li>Teams should report at the backstage at least 15 minutes prior to the scheduled time.</li>\r\n<li>The use of fire, water, colour powder, popper, and smoke in any form that damage the stage is prohibited.</li>\r\n<li>Sound track should be submitted to the coordinators at least an hour before the program in MP3 format in pen drive.</li>\r\n<li>The coordinators will not be responsible for any issues related with the USB.</li>\r\n<li>Judgment will be based on the choreography, synchronization, costumes, and overall presentation.</li>\r\n<li>The team can follow any style.</li>\r\n<li>Vulgarity in any form is strongly discouraged.</li>\r\n<li>The decision of the judges will be final.</li>\r\n</ul>', 2, 2, 'Auditorium', 200, 'team', '9K', NULL, NULL, NULL, 'Nivina', '7025991837', 'Meera', '9526578309 ', 0, '2019-03-16 00:00:00', '2019-03-28 00:00:00', 'double_trouble', '$2y$13$44ejOFHQqUGkRTcppuMU1eED783/opDHy6P50p3BugWpzT/9ygcjC', 'double_trouble', 0, ''),
(33, 10, 'B.O.B. (Battle Of B-Boys)', 'Break a beat and bring on the hustle! It\'s time for the biggest B-Boying battle of them all! Think no twice, just let the feet go!', '<p>All hail B-Boys and Girls! Come gather with your downrocks and freezes, and set the ground high on flames! Show the world the stunning athletic street style you own! We welcome you to B.O.B. (Battle Of B-Boys) at HESTIA \'19, a voyage through the streets of New York in the lanes of TKM. To all the b-boys and b-girls out there, the streets are calling for you. Light it up!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>The competition is open to all.</li>\r\n<li>This is an individual event.</li>\r\n<li>Registration must be done beforehand.</li>\r\n<li>The songs will be played by the Disc Jockey.</li>\r\n<li>Use of any dangerous property to aid the performance is strictly not allowed.</li>\r\n<li>No vulgar practices are entertained.</li>\r\n<li>The decision of the judges will be final.</li>\r\n</ul>', 1, 1, 'BasketBall Court', 200, 'head', '15K', NULL, NULL, NULL, 'Aravind', '8156969762', 'Nandana', '8943115566', 0, '2019-03-16 00:00:00', '2019-03-28 00:00:00', 'bob', '$2y$13$waCo6xgCp/w5fEm1P3nERuhh3CyLoCMPf1DQ1Bkyvx0cyGCfYB2XG', 'bob', 0, ''),
(34, 11, 'NIMISHAM - ONE MINUTE VIDEO CONTEST', '\"It\'s not where you take things from, it\'s where you take them to\" - Jean Luc Godard', '<div>Every frame tells a story. What&rsquo;s yours?</div>\r\n<div>Are you that maniac with an eye of detail and a mind for fast invention?</div>\r\n<div>Then join us and send in your one minute videos.</div>\r\n<div>&nbsp;</div>\r\n<div>Hestia \'19 invites inveterate, intriguing and impressive videos from all the looming young talents out there.</div>\r\n<div>&nbsp;</div>\r\n<div>Show us what little extra that your frame can catch in ONE MINUTE.</div>\r\n<ul>\r\n<li>There won\'t be any theme for competition.</li>\r\n<li>Videos can be either shot on digital camera or mobile phones.</li>\r\n<li>Upload the video in google drive and whatsapp your entries to number given below.</li>\r\n</ul>\r\n<div><strong>RULES:</strong></div>\r\n<ul>\r\n<li>The video should not exceed one minute.</li>\r\n<li>Musically,dubsmash, tik-tok videos etc. are not allowed.</li>\r\n<li>Videos on any controversial issues are not allowed.</li>\r\n</ul>', 1, 1, '', NULL, NULL, '7K', NULL, NULL, NULL, 'Vishnu ', '8943751114', 'Nirmala ', '9446871327', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 'nimisham', '$2y$13$Uxm9n4aiIa2pd9mW41DOK.rxnDC7zuXOdKUdnT/fYQ4WoyU7IaNAO', 'nimisham', 0, ''),
(35, 11, 'MIME', 'Come, act out your story and express the emotions that words cannot convey! ', '<p>Come, act out your story and express the emotions that words cannot convey!</p>\r\n<p>The clumsy tool of words aren\'t always enough when it comes to the expression of an idea. Hestia \'19 sets for you a stage to tell us a story with anything from the sway of an arm to the twitch of your lips, anything except your voice that is. So gather your fellow storytellers, and bring to us an idea so rich that it doesn\'t need the aid of words.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>There can be upto 11 (including accompanists) per team.</li>\r\n<li>The duration of the act should not be more than 10 minutes.</li>\r\n<li>The teams will be evaluated on the basis of makeup, performance, creativity, theme and teamwork.</li>\r\n<li>Indecent behaviour or costume is prohibited.</li>\r\n<li>The decision of the judges will be final.</li>\r\n<li>In case of disputes, the decision of coordinators will be final and binding.</li>\r\n</ul>', 7, 11, 'Auditorium', 300, 'team', '10K', NULL, NULL, NULL, 'Asish Damodaran', '8281925106', 'Bianca Sarah Binoy', '8281679037', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'mime', '$2y$13$5nH81Q/PPcA5Idxx.PhUBOg0hyA.eILXw5P4nSHrqPSpCp16O78/6', 'mime', 1, ''),
(36, 11, 'SPOT DUBBING', 'If impersonation, dialogue delivery and voice modulation is your strong suit, look no further. Your time to shine has finally arrived!', '<p>We all enjoy the impressions of our favourite celebrities. It makes us laugh and leaves us awestruck. But the time has now come to step up the game. Unveil the hidden impressionist in you at the SPOT DUBBING contest at Hestia \'19. Extreme skill, sharp wit and great presence of mind are what makes it sell. So ready your throats and get ready to grab your prizes, the stage is set for you.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>This is an individual event.</li>\r\n<li>Contestants should bring the video to be dubbed.</li>\r\n<li>Duration of the video shouldn\'t exceed 10 minutes.</li>\r\n<li>The criteria for judgement would be the command of voice, impression skills and the degree of Sync.</li>\r\n<li>Vulgarity in acts is not entertained and will lead to immediate disqualification.</li>\r\n<li>Decision made by the judges will be final and binding.</li>\r\n</ul>', 1, 1, 'Mech Central Square', 100, 'head', '3K', NULL, NULL, NULL, 'Arjun Raj', '9744080646', 'Muhammed Sooraj', '9746856575', 0, '2019-03-15 00:00:00', '2019-03-30 00:00:00', 'spot_dubbing', '$2y$13$irEYSbJH8zZ4TsXIo5tpwO6nUSSrRiiiKNDI3JnBsW7nw8E4lefVm', 'spot_dubbing', 1, ''),
(38, 11, 'MONOACT', '“All the world\'s a stage, and all men and women merely players” -William Shakespeare', '<p>To perform an entire story with differing characters through a single person, Mono-acting is one special talent to possess. An ideal platform beckons for all such versatile actors who can solely travel through from smile to anger to humour to every emotion possible. Get ready to express yourself full on, as the stage lights up and all eyes turn to you, at HESTIA \'19.</p>\r\n<p>Rules and Regulations:</p>\r\n<ul>\r\n<li>This is an individual event.</li>\r\n<li>Participants should restrict their entire performance to 10 minutes</li>\r\n<li>Judgement is based on voice command, originality, depth of content &amp; general impression.</li>\r\n<li>Indecent behaviour / obscene content will lead to disqualification.</li>\r\n<li>Performances shall not hurt any religious sentiments.</li>\r\n<li>Decision of judges will be final and binding</li>\r\n<li>In case of any disputes, decision of the coordinators will be final and binding.</li>\r\n  </ul>', 1, 1, 'APJ Park', 100, 'head', '3K', NULL, NULL, NULL, 'Asish Damodaran', '8281925106', 'Dany Joshua', '7012131613', 0, '2019-03-15 00:00:00', '2019-03-30 00:00:00', 'monoact', '$2y$13$zXkot52LPVhsaARumgOeReXL3l1co1lof5PPlJx7JkXhfzgbfRe4W', 'monoact', 1, ''),
(39, 11, 'MIMICRY', 'This Hestia, show off your versatility on the stage as you dazzle the crowd in a soulful display of expressions and emotions in this playdown of humour and satire.', '<p>The art of imitation is one that requires the discipline of mind, voice and an acute skill of observation. Polish your vocal chords for the fiery war of the doppelgangers as HESTIA \'19 gears up for the MIMICRY competition.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>The maximum time allotted is 7 minutes.</li>\r\n<li>The criteria for judgement includes command of voice, impression skills, originality, general impressions, perfection, creativity and complexity.</li>\r\n<li>Vulgarity in acts is not entertained and will lead to disqualification.</li>\r\n<li>All decisions made by the judges will be final and binding.</li>\r\n</ul>', 1, 1, 'Mech Central Square', 100, 'head', '3K', NULL, NULL, NULL, 'Sharath Shaji', '9061714290', 'Abhishek S Kini', '7025078078', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'mimicry', '$2y$13$5oWi6Ef6MkQYPdCSz9LwV.rmgKoraxDnxhenDvE/jq7jU201spCtW', 'mimicry', 1, ''),
(40, 11, 'DRAMA', '“What is Drama but life with all the boring bits cut off?” - Alfred Hitchcock', '<p>Drama is the combination of all the arts known to man, thus making it either the most pure or the most impure of all arts. Yet the power it holds over the audience is unparalleled. As the curtain rises and the spotlights focus on HESTIA \'19, are you ready to get on stage to express, enthral and entertain?</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>A maximum of two teams per college is allowed.</li>\r\n<li>A participant cannot be part of more than one team.</li>\r\n<li>All members should bring their College ID card.</li>\r\n<li>Time limit: 30 minutes (excluding 5 minutes preparation time)</li>\r\n<li>The medium of narration can be English, Malayalam and Hindi.</li>\r\n<li>The team should bring their own props. Only basic furniture and chairs will be provided (requirement should be notified in prior).</li>\r\n<li>The decision of the judges will be final and binding in any case.</li>\r\n  <li>Abusive and vulgar usages of language or action will not be entertained.</li>\r\n</ul>', 2, 20, 'Auditorium', 300, 'team', '10K', NULL, NULL, NULL, 'Supreeth Bare', '9746230071', 'Dany P. Joshua', '7012131613', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'drama', '$2y$13$TjVimp5vu2jWjw9fgALIp.ofuzLJP7sPAe8s/nIe2YO2y5ngkSbmO', 'drama', 1, ''),
(41, 12, 'VOICE OF HESTIA', '\"For me, singing is the most natural thing in the world. I\'ve grown up with it and I know I\'ve got that gift.\" - Stella Mccartney', '<p>Are you one of those talented singers who could relate to these words? Have you got what it takes to create magic through the rhythm of your words? Then TKM presents before you \'Voice of Hestia\'. Own the stage; give it all that you got, channel your fears and let it never waver your voice.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>Maximum time limit is 7 minutes.</li>\r\n<li>The event will be in 2 rounds:</li>\r\n<li>Prelims: Participants can choose any song of their choice<br />(irrespective of language). Karaoke is permitted.</li>\r\n<li>Finals: The finalists will have to perform two songs - a melody<br />and a fast number. The performance in the finals should only be in the regional language with the accompaniment of karaoke.</li>\r\n<li>No separate events for male and female.</li>\r\n<li>It is mandatory that karaoke has to be submitted at least one hour<br />before the performance in a CD or a pendrive.</li>\r\n  <li>The decision of the judges will be final.</li>\r\n</ul>', 1, 1, 'Mech Central Square', 150, 'head', '13K', NULL, NULL, NULL, 'Aravind Sasi', '9496639289', 'Nandanu', '9562591716', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'voice_of_hestia', '$2y$13$E4UYrm.eeKEeR/pOcevW.u.OoyDAffrtnmVUZYOCpJxWc/Ppf/hdO', 'voice_of_hestia', 0, ''),
(42, 12, 'DUALITY', '\"The only thing better than singing is more singing\"', '<p>Sing. Beatbox. Rap. Express. HESTIA 19 is giving everyone of you young artists out there the chance to give it your all on stage. So grab a partner, take your cough drops and get singing.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Participants can bring a maximum of 2 instruments.</li>\r\n<li>The maximum time would be 6 mins.</li>\r\n<li>Karaoke should be brought in a USB.</li>\r\n<li>Judge\'s decision will be final.</li>\r\n</ul>', 2, 2, 'APJ Park', 200, 'team', '8K', NULL, NULL, NULL, 'Ayisha', '7559927400', 'Jahana', '8086859378', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'duality', '$2y$13$v6rNqxzInRqFonWCYS3qs.Zf41r5pLDMIbkrsWy3r7jk5gRGD3zxG', 'duality', 1, ''),
(43, 12, 'ACAPPELLA', 'Were you always good at changing your voice range easily or just singing in different pitches?', '<p>Welcome to HESTIA &lsquo;19\'s ACAPPELLA. Get ready to showcase your vocal skills as a group in a competition like no other. The event will probably go through a lot of hoarse voices and very high notes but that\'s just a result of giving it your all. So pick yourself up and be there on time.</p>\r\n<p>Rules and regulations:</p>\r\n<ul>\r\n<li>Team can have a maximum of 8 participants.</li>\r\n<li>No instruments should be used.</li>\r\n<li>The decision of the judges will be final.</li>\r\n</ul>', 3, 8, 'Mech Central Square', 300, 'team', '8K', NULL, NULL, NULL, 'Manu Krishnan', '9072872773', 'Shahin Hashim', '7034227424', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'acappella', '$2y$10$rHWsoREERblNDbGgkgf8auRv0ZHcmO8bomlgBvPPuKrvJwbgeKqFW', 'acappella', 1, ''),
(44, 13, 'GRAPHITUM', 'Let your pencils utter while your mind ponder on your thoughts.', '<p>Here\'s a chance for you to show off your creative side and technical sketching skills as you let the pencils speak for you. At Hestia &lsquo;19, HIWAGA \'19 is eager to provide you with a platform to express your thoughts and vision.</p>\r\n<p>Rules and Regulations:</p>\r\n<ul>\r\n<li>This is an individual competition.</li>\r\n<li>Participants will be allotted 2.5 hours of time each.</li>\r\n<li>Topic will be given on the spot.</li>\r\n<li>Paper will be provided at the venue.</li>\r\n<li>Medium: Pencil and paper.</li>\r\n<li>Charcoal and colour pencils are not allowed.</li>\r\n</ul>', 1, 1, '', 50, 'head', '2K', NULL, NULL, NULL, 'Rinith', '7907162970', 'Alisha', '9447314015', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'graphitum', '$2y$13$qAYqzT0FuvMT4qtgb1PLKO8.DguxJY2Ekmm9HJGIxvWo7EOQiXowq', 'graphitum', 1, ''),
(45, 13, 'AQUARELLA', 'Dip your brush into your soul and paint your colours into your painting.', '<p>\"I dream of painting and then I paint my dream.\" - Vincent Van Gogh.</p>\r\n<p>Grab your brushes and enter the world of your dreams! Hiwaga \'19 invites you to give life to your world of colours.</p>\r\n<p>Rules and regulations:</p>\r\n<ul>\r\n<li>This is an individual competition.</li>\r\n<li>Participants will be allotted 2 hours of time.</li>\r\n<li>Topics will be given on time.</li>\r\n<li>Papers will be provided at the venue.</li>\r\n<li>Participants are expected to carry other required materials.</li>\r\n</ul>', 1, 1, '', 50, 'head', '2K', NULL, NULL, NULL, 'Nazrin', '9745974301', 'Saniya', '7012937808', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'aquarella', '$2y$13$mrgKT8GkFWwoMmeFArxHR.3HZPn752kjKlJxXUa75OCDJTZG9X/h2', 'aquarella', 1, ''),
(46, 13, 'ALWAAN', 'As Mehendi adorns the hands, get  set to stain your palms with the only essence of love.', '<p>Temporary yet exquisite, the love for mehendi finds no bounds. Got the knack for those cerise patterns? Then this is your realm. Come stain your hands with the hues of Hiwaga, at Hestia &lsquo;19!</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>The maximum number of participants per team is 2, including an artist and the subject (model).</li>\r\n<li>Participants will be allotted 1.5 hours of time.</li>\r\n<li>Participants can apply mehendi on their own hand or another person&rsquo;s hand.</li>\r\n<li>Participants should apply mehendi on the palmar side of a single hand only.</li>\r\n<li>A cone of mehendi will be provided for each team.</li>\r\n</ul>', 1, 1, '', 50, 'head', '2K', NULL, NULL, NULL, 'Rabeeha', '8281306940', 'Shabhana', '9846628794', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'alwaan', '$2y$13$scP1U0gTaJikbozEqpjFgOFkxbWYkaXfmzwZj7IhVQmUWJ6SW1xMW', 'alwaan', 1, ''),
(47, 13, 'CHIRAAD', '\"Master pieces aren\'t just limited to canvas.\"', '<p>\"Master pieces aren\'t just limited to canvas.\"</p>\r\n<p>Let your fingers be the rain to invoke the petrichor.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a maximum of 2 participants.</li>\r\n<li>Participants will be allotted 2 hours of time.</li>\r\n<li>Topic will be given on the spot.</li>\r\n<li>The participants should bring their own modelling tools if required.</li>\r\n<li>Participants are allowed to use only the clay provided at the venue.</li>\r\n<li>Reinforcements should not be used in the model.</li>\r\n</ul>', 1, 2, '', 100, 'team', '2K', NULL, NULL, NULL, 'Ashwini', '9400499185', 'Anamika', '9497025085', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'chiraad', '$2y$13$ypZkAX5WQeN.FyavE0LFH.QzCEdtz3lnSrjkIAhEqiR58e8roFmqi', 'chiraad', 1, ''),
(48, 13, 'GRAFF-RAP', 'Ever been fascinated by bubble letters and bright colors?', '<p>Ever been fascinated by bubble letters and bright colors? Ever stood staring at those walls, poles and canvases? Ever dreamt of pouring out the colors of your mind? If yes, then this time do it to win it, win the canvas, win some hearts, win some awestruck faces! Hestia &lsquo;19 brings to you the graffiti competition!</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>There can be a maximum of 2 members per team.</li>\r\n<li>The maximum time allotted is 3 hours.</li>\r\n<li>A space of 4x3ft will be provided.</li>\r\n<li>Topics will be given on the spot.</li>\r\n<li>Participants should bring the required materials for the competition.</li>\r\n<li>Wordings and illustrations which are inappropriate for a campus should not be used.</li>\r\n</ul>', 2, 2, '', 100, 'team', '7K', NULL, NULL, NULL, 'Shamil', '9746749588', 'Abhinand', '8129475765', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'graff_rap', '$2y$13$ehjdqvOo1nB5Wo4jhLo67OIntnRgiZtMwJwesv/I8.SAyiM4PqZYS', 'graff_rap', 0, ''),
(49, 13, 'VEIL IT', '\'The painter has the Universe in his mind and hands.\' - Da Vinci', '<p>We are all artists painting our lives upon the canvas of reality. Let\'s not restrict our colours to just papers. Get ready with your brushes because at Hestia &lsquo;19, Hiwaga is in search of proficient face painters. Mix the colors and paint your emotions!</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a maximum of 2 members.</li>\r\n<li>Colors will be provided at the venue.</li>\r\n<li>Designs should not be copied.</li>\r\n<li>The maximum allotted time is 1.5 hours.</li>\r\n<li>Only primary colors will be provided. Participants can bring colors that are not allergic to human skin, if needed.</li>\r\n<li>Painting tools will not be provided.</li>\r\n<li>Topics will be given on the spot.</li>\r\n</ul>', 2, 2, '', 100, 'team', '3K', NULL, NULL, NULL, 'Ida', '9072245842', 'Anu', '7907271427', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'veil_it', '$2y$13$eUrKc6N9BKTNe3tEVjcnOe6sgvy/Rng4UGH1NV3EoJYBpUb8nj2WS', 'veil_it', 1, ''),
(50, 1, 'Debugger', 'It\'s not a bug, it\'s an undocumented feature.', '<p>\"Debugging &nbsp;is twice as hard as writing the code in the first place. Therefore, if you write the code as cleverly as possible, you are by definition, not smart enough to debug it.\"</p>\r\n<p>Do you pride yourself in being a coder? Well then here\'s a challenge for you. Prove your worth by solving all the bugs that we have hidden for you!</p>\r\n<p>You are expected to debug the programs with the minimum number of changes made.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>Each team can consist of a maximum of 2 members.</li>\r\n<li>You can choose either C or C++ as your programming language.</li>\r\n<li>The event will have 3 rounds, each of 30 minutes.</li>\r\n<li>Each round will be an eliminator.</li>\r\n<li>The task is to compile the code by making the minimum number of changes to the code.</li>\r\n<li>All decisions taken by the judges will be final.</li>\r\n</ul>', 1, 2, 'OSN Lab', 100, 'team', '6K', NULL, NULL, NULL, 'Alan Jacob', '9497435791', 'Karishma Elsa Johns', '9497038770', 50, '2019-03-15 00:00:00', '2019-03-30 00:00:00', 'debugger', '$2y$13$sbRUIvXoFCPZpbFobCDgZ.I1oNHfw46mG7xY39r2.zBbIzYfbiyPu', 'debugger', 1, ''),
(51, 1, 'Instant Coding', 'Write programs using an unfamiliar esoteric language given by reading its documentation.', '<p>&ldquo;The only way to learn a new programming language is by writing programs in it.&rdquo;</p>\r\n<p>Confident enough you can learn a new programming language overnight?</p>\r\n<p>Take the ultimate test of Instant Coding. Learn one among the so-called &lsquo;crazy programming languages&rsquo; and complete coding challenges within strict time constraints. Compete with the fastest learners, prove yourself and win some amazing prizes at Hestia \'19!</p>\r\n<p><strong>Event Layout:</strong></p>\r\n<p>Read the docs to learn an unfamiliar esoteric language in minutes. Solve a set of programming problems given using that language within the stipulated time.</p>\r\n<p>The event will consist of two rounds. The first will be an elimination round. Only the best performers will be selected to the second round where the participant will be given an esolang, its offline docs and a set of programs to write using that language.</p>\r\n<p>Rules and regulations:</p>\r\n<ul>\r\n<li>This is an individual event.</li>\r\n<li>There will be a total of 2 rounds.</li>\r\n<li>Internet access will be restricted.</li>\r\n<li>Use of any electronic devices such as mobile phones is not allowed.</li>\r\n<li>The participants should attempt to solve the given challenges using an esoteric language given.</li>\r\n<li>The final decision will be taken by the judging committee.</li>\r\n<li>Finalized rules will be disclosed 5 minutes before the actual event.</li>\r\n<li>The number of registrations is limited.</li>\r\n</ul>', 1, 1, 'OSN Lab', 100, 'head', '8K', NULL, NULL, NULL, 'Adarsh', '8281546214', 'Tibin', '7034747436', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'instant_coding', '$2y$13$EwNhlg5H6JG0XhkNgJhk3OSiU/ulzrMpEdGu8r2YAHjV3DNqw8wVK', 'instant_coding', 1, ''),
(52, 6, 'COIL GUN', '“Ideas pull the trigger, but instincts load the gun.” - Don Marquis', '<p>Get ready to kick-start and ignite your trigger muscles, for, at <strong>Hestia \'19</strong>, you will have the opportunity to build and control your own Coil Gun - the coil gun is a type of projectile accelerator consisting of one or more coils used as electromagnets in the configuration of a linear motor that accelerates a ferromagnetic or conducting projectile to high velocity. Integrate the techniques and concepts of Gauss along with some of your own, as you craft an ultimate weapon to prove you are unparalleled and second to none!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Each team can have a maximum of 3 members.</li>\r\n<li>Team members will have to produce valid ID cards of their institute.</li>\r\n<li>Cross college teams are permitted.</li>\r\n<li>DC supply will be provided.</li>\r\n</ul>\r\n<p><strong>Event Layout :</strong></p>\r\n<p>The event consists of two rounds which will put your knowledge, skill and accuracy to test.</p>\r\n<p>In the first round, all teams should provide a brief explanation of their gun. All necessary details and specifications of coil gun are to be specified by the contestants.</p>\r\n<p>The second round will test the working of the coil gun. The efficiency and the strength of the gun will be tested in two stages. In stage 1, the range of the coil gun will be tested by giving three chances to the contestants to project the projectile object. In stage 2, the contestants should hit a given dummy target as accurately as possible with their gun from a specified distance within the range of the gun.</p>', 1, 3, '205', 200, 'team', '6K', NULL, NULL, NULL, 'Vishal N', '9946318422', 'Albin Joy', '9645578876', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'coil_gun', '$2y$13$RW1gRGdqJFKzXKXRk7JjYudy6YPZHHnTHxQ4xw0nsj0OWYGupJe16', 'coil_gun', 1, ''),
(53, 6, 'MESH IT UP', 'The circuit making challenge.', '<p>Ever wondered what it feels like to design messy meshes and fabricate complex nodes?</p>\r\n<p>Waiting for a new brain twisting challenge to prove your mettle? Here is your ideal opportunity!</p>\r\n<p>Mesh it up awaits you at HESTIA &lsquo;19 with an assemblage of electrifying battles, so roll up your sleeves, put on your armour and get ready to grab the accolade.</p>\r\n<p><strong>Rules and Regulations</strong></p>\r\n<ul>\r\n<li>Each team should consist of only 3 members.</li>\r\n<li>The event will consist of three time-bound rounds.</li>\r\n<li>All materials will be provided at the venue.</li>\r\n<li>The usage of mobiles, calculators or any other gadgets is prohibited.</li>\r\n<li>Teams will be judged on the basis of speed, neatness and accuracy.</li>\r\n<li>The decision of judges and organisers would be final.</li>\r\n</ul>\r\n<p><strong>Event Layout:</strong></p>\r\n<p>Round 1 will be a pen and paper round, comprising of MCQ questions on general electrical engineering and aptitude. A total of 30 minutes will be provided to answer 45 questions. The top 10 teams would qualify to the next round.</p>\r\n<p>In round 2, each team will be given a crossword puzzle to solve. The solved puzzle will direct you to the circuit to be designed. A time of one hour will be given to design and assemble the circuit. Speed, neatness and accuracy will be considered for judgement, and an maximum of 5 teams will qualify to the final round, purely be based on judges discretion.</p>\r\n<p>In round 3, each qualifying team will be given 3 different circuit diagrams along with required components, and each member has to work on one circuit. All teams will receive the same circuits. At the sound of a buzzer, members need to interchange their circuits &nbsp;and continue the design of circuits which were previously handled by another team member. No communication will be allowed between the teammates during this round. On the completion of design, the circuits will be tested and results will be based on accuracy and neatness. The decision of judges will be final.</p>', 1, 3, 'Power Electronics Lab', 250, 'team', '8K', NULL, NULL, NULL, 'Akash', '9495067095', 'Caroline', '9495435750', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'mesh_it_up', '$2y$13$3bVtmAmpg6me/ASktx/nb.Z.RfeVVA1inOI5gVR1vXsAjdfX2MW3i', 'mesh_it_up', 1, ''),
(54, 6, 'STEINMETZ', 'Bring out the engineering genius inside you.', '<p>If you think you have what it takes to be the next Elon Musk, then HESTIA &lsquo;19 has in store an interesting platform for all the electrical engineers out there who want to prove their calibre. We are on a hunt for the next dexterous engineer! All you have to do is to figure out through the three rounds testing your proficiency in circuitry, coding and interpersonal skills.So put on your thinking caps and solve through the tricky questions through your team\'s collective effort!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Each team can have a maximum of 3 participants.</li>\r\n<li>The event will consist of 3 rounds.</li>\r\n<li>Preliminary rounds will be conducted based on the number of entries.</li>\r\n<li>Usage of mobile phones, calculators and other electronic gadgets is prohibited.</li>\r\n<li>Decision of the program coordinators shall be final.</li>\r\n</ul>', 2, 3, '', 150, 'head', '15K', NULL, NULL, NULL, 'Jovin', '8281712519', 'Aneena', '8547269444', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'steinmetz', '$2y$13$426pIMZQ4SsS8myFbzxjleGDkz4ba/iXZhE2cNQo.DdJWu5Xyjddy', 'steinmetz', 1, ''),
(55, 6, 'GLOW IT OR BLOW IT', 'A wiring challenge for the electrical enthusiasts out there.', '<p>If the concept of electric voltages and motion of charges excite you, if you&rsquo;re sure you know all about the movement of charges, then this is the chance to decipher your ideas to the next level down the line. Come and make the electric impulses existing within your fingers run through the wires of an electric circuit! HESTIA &lsquo;19 presents GLOW IT OR BLOW IT for all the electrical enthusiasts out there. The task for each team would be to solve an electrical circuit in the shortest time possible. So brush up your basics and get ready to reel!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a maximum of 3 members.</li>\r\n<li>Team members should produce their college ID card.</li>\r\n<li>Usage of mobile phones, calculators or any other gadgets is strictly prohibited.</li>\r\n<li>Preliminary rounds will be conducted based on the number of entries.</li>\r\n<li>The event will consist of two rounds, wherein each team will have a circuit to solve.</li>\r\n<li>The decision of the event coordinators will be final.</li>\r\n</ul>', 1, 3, 'EEE Workshop', 200, 'team', '5K', NULL, NULL, NULL, 'Shahana', '7994692397', 'Abhiraj', '9747213718', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'glowit_or_blowit', '$2y$10$1N9UhpeVN.kNdRDqFFQMhO/3anO7trpY56Qfgl4U60tZTeQPsz4a2', 'glow_it_or_blow_it', 1, ''),
(56, 6, 'CIRCUITRIX', 'Novices does debugging right but only wizards resolve the trixes in the circuit!', '<p>Want to showcase your prowess in fixing faulty circuits? Then fret not, it\'s time to warm up your fingers and refresh your tactics. This summer, HESTIA \'19 presents you with a golden chance to storm your brain and bring out the master bug fixer in you, an event that tests how your systematic and analytical approaches work to find out the corner stone, and how you fix it out!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a maximum of two members. Cross-college teams are also allowed.</li>\r\n<li>The event will have two rounds, a prelims and a finals. The final phase of the event will consist of two practical rounds that will test and improve your debugging skills.</li>\r\n<li>Scores from all the rounds will be considered to calculate the final scores.</li>\r\n<li>Safety should be given prime importance.</li>\r\n<li>Practical sessions will be assessed based on the completion time.</li>\r\n<li>Participants will not be permitted to use mobile phones or any other external sources of information. Clues will be provided.</li>\r\n<li>The decision of the program coordinators will be final.</li>\r\n</ul>', 1, 2, '', 200, 'team', '6K', NULL, NULL, NULL, 'Sandeep', '8281778759', 'Kintu', '8156893570', 0, '2019-03-15 00:00:00', '2019-03-29 23:59:00', 'circuitrix', '$2y$13$Xh0VrKbJFXocj5KIlBOp..st5jJ66suzJkXdrKcaquJIWyNhvbTwS', 'circuitrix', 1, ''),
(57, 1, 'Code Fortress', 'Coding competition that challenges your creativity, logic and knowledge.', '<p>Focused, yet flexible; logical, yet creative; the qualities of the ultimate coder. Are you that ultimate coder? Then prove your ingenuity and coding skills by bringing down our code fortress.</p>\r\n<p>You will face two rounds, wherein the first will test your creativity and out-of-the box thinking, and the second will be a series of algorithmic challenges designed to test your logical and programming skills to the extreme. Think you can bring down our code-fortress? Get a chance to find out, and win some amazing prizes at Hestia \'19!</p>\r\n<p><strong>Rules and regulations</strong>:</p>\r\n<ul>\r\n<li>A team can consist of a maximum of 2 participants.</li>\r\n<li>There will be a total of 2 rounds.</li>\r\n<li>Internet access is available only for the first round.</li>\r\n<li>Internet access and any other references during the second round is prohibited.</li>\r\n<li>Use of any electronic devices such as mobile phones are not allowed.</li>\r\n<li>The participants can code in C/C++.</li>\r\n<li>The decision of the judging committee will be final.</li>\r\n<li>Finalized rules will be disclosed 5 minutes before the actual event.</li>\r\n<li>The number of registrations will be limited.</li>\r\n</ul>', 1, 2, 'OSN Lab', 100, 'team', '8K', NULL, NULL, NULL, 'Madhav Manoj', '9020463740', 'Keerthi V', '8281992530', 0, '2019-03-16 00:00:00', '2019-03-30 00:00:00', 'code_fortress', '$2y$10$/n4kFIGLm4K0nZ9SfM2LweyRZp.MJlLliyFVPWoD7ExlJ9MvDXrK2', 'code_fortress', 1, ''),
(58, 16, 'LetsPy', 'LetsPy India Tour is going to be held in 10 different cities and 2500+ attendees will be taught Python programming in events starting from 15th February to 15th of April, 2019', '<p><em><strong>while</strong>(nosuccess)<br />&nbsp;&nbsp;&nbsp; tryAgain( );<br /><strong>if</strong>(dead)<br /><strong>&nbsp;&nbsp;&nbsp; break</strong>;</em></p>\r\n<p>In India, students are a victim of various myths and one of the popular ones is &lsquo;You have to learn C, C++ and Java respectively in order to be a programmer.&rsquo; This Letspy Bootcamp introduces them to a powerful language that doesn\'t need any prerequisite knowledge.. <strong>Python</strong></p>\r\n<p>People are less aware of contributing to open source, how communities work and how they can get involved. Students invests 40-50K INR and around 6 months in average to learn a programming language</p>\r\n<p>Present yourself with the opportunity of attending the two day long <strong>LetsPy Workshop</strong><br />conducted in accordance with <strong>Hestia 2019!</strong></p>\r\n<p><br />Students will be provided with:</p>\r\n<ol>\r\n<li>Attendee kit</li>\r\n<li>T-shirt</li>\r\n<li>Brunch</li>\r\n<li>Software</li>\r\n<li>PPT\'s and jupyter notebooks</li>\r\n<li>Swags from <strong>Mozilla and GitHub</strong></li>\r\n</ol>', 1, 1, 'Foss Lab', 1000, 'head', NULL, NULL, NULL, NULL, 'Sidharth S K', '8281385304', 'Samar Musthafa', '9074002890', 12, '2019-03-17 00:00:00', '2019-03-28 00:00:00', 'letspy', '$2y$10$jIQNvmJrKSas08pg8RyqoOD8Z0rIG0F9xdcVRZz3meY/yjS4CceRW', 'letspy', 0, ''),
(59, 16, 'Industrial Automation: PLC & SCADA', '“Once a new technology rolls over you, if you’re not part of the steamroller, you’re part of the road.”— Stewart Brand', '<p>In the ever-changing modern world, technology has become ingrained in our everyday lives, and keeping pace with its exponential growth has become more of a necessity than a luxury. &nbsp;Knowing how new technology can help revolutionize the world, is a cornerstone of engineering because at the end of the day, science is just \"philosophy\" if it doesn\'t help the common man. </p>\r\n<p>With the above goal in mind, HESTIA \'19 presents a workshop on &nbsp;\"Industrial Automation: PLC &amp; SCADA\" to explore the latest innovations that can redefine our industrial sector.</p>\r\n<strong>Highlights:</strong>\r\n<ul>\r\n<li>In-depth, hands-on experience. </li>\r\n<li>Certification from IIT Madras.</li>\r\n</ol>', 1, 5, '', 700, 'head', NULL, NULL, NULL, NULL, 'Jishnu', '9544648443', 'Sanjeev', '8089894745', 56, '2019-03-18 00:00:00', '2019-03-30 00:00:00', 'industrial_auto', '$2y$10$x5U1YlNQqC98UrQj4yxXoeMpBgEmmnB1wVSKP4TeBmUuRxDvzbuVy', 'industrial_automation', 0, ''),
(60, 7, 'G-CODER', 'Code it to control it.', '<p>The era of machine tools for cutting, shaping and milling your work piece demanding man power is gone for the brain power to take its place. The machine is all yours. Code it to control it.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a maximum of 2 members.</li>\r\n<li>Candidates are required to create part programs for various tool parts as specified by the instructor.</li>\r\n<li>Candidates will be given 20 minutes for a part programming. Time may vary depending upon the difficulty level.</li>\r\n<li>Part programming will be done on the G-code simulator application.</li>\r\n<li>Participants will not be allowed to switch tabs in between or move away from the simulator programme.</li>\r\n<li>Any malpractices will lead to immediate disqualification.</li>\r\n<li>Participants will be allotted systems at the venue, and are not allowed to use personal laptops.</li>\r\n<li>Participants should maintain communication with the coordinators</li>\r\n<li>The event would be void unless there is a minimum of &nbsp;participants.</li>\r\n<li>Rules may change with/without prior notice.</li>\r\n<li>Event manager&rsquo;s decision will be final</li>\r\n</ul>', 1, 2, 'Workshop Block', 100, 'head', '8K', NULL, NULL, NULL, 'Saheer P', '9847682071', 'Linjo Rejoy', '9495343658', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'g_coder', '$2y$13$hagHS92CSUZclLvoqEaIGOcMXFLorhy4mrP4laHgtTP3r9mA.DR0e', 'g_coder', 1, ''),
(61, 7, 'HOW THINGS WORK', 'Decipher the what, why and how of machines.', '<p>Are you the machine master? Do you have what it takes to figure out how they work? Your call has come to unravel the know-hows. Bring out your mechanical skills this summer for HESTIA \'19 brings to you &lsquo;How Things Work&rsquo;.</p>\r\n<p><strong>Event Layout:</strong></p>\r\n<p>The event consists of 2 rounds.</p>\r\n<p>The first round will be a written test on the basics of machines.</p>\r\n<p>The second round will comprise of 4 stages: A general round (pass allowed), visual round (pass allowed), a specific round (pass allowed) and a practical presentation round (to explain the given component&rsquo;s function and to make the component to perform the given mechanism)</p>\r\n<p><strong>Rules and regulations :</strong></p>\r\n<ul>\r\n<li>Each team should consist of 2 members.</li>\r\n<li>No kits or aids will be provided.</li>\r\n</ul>', 2, 2, 'Workshop Block', 100, 'team', '6K', NULL, NULL, NULL, 'Gokul A', '7012670308', 'Mathias Binoson', '9048473672', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'how_things_work', '$2y$13$N.uGjh4cmdLJ9WDRxSok7O1lwsgQrzSIAIarQALN4zkdgLTMDE1/q', 'how_things_work', 1, ''),
(62, 7, 'Cadwar', 'An event to bring out your graphical skills.', '<p>Visualization is one of the most important traits of any engineer, since using imagination to expose your ideas to the outside world is one task faced by engineers. Put your creativity into action and bring out your graphical skills in CADWAR at Hestia &rsquo;19!</p>\r\n<p><strong>Rules and regulation:</strong></p>\r\n<ul>\r\n<li>Each team can have a maximum of 2 members.</li>\r\n<li>Only Solidworks software is allowed and no other design softwares are permitted.</li>\r\n<li>The participants are not permitted to use their own laptops.</li>\r\n<li>The decision of judges will be final and binding.</li>\r\n</ul>\r\n<p><strong>Event Layout:</strong></p>\r\n<p>The event will consist of three rounds:</p>\r\n<p>In the first round, candidates will be given MCQ questions based on CAD and design of machine elements to filter the best candidates.</p>\r\n<p>In the second round, using solidworks software, candidates are required to create models as specified in the instructions in the allotted time. Systems will be provided and candidates are not permitted to use their own laptops.</p>\r\n<p>In the third round, the candidates will have to design a model based on the given problem and find the best solution without failure.</p>', 1, 2, 'CAD Lab', 100, 'head', '6K', NULL, NULL, NULL, 'Vaishnav M.K', '9497036231', 'Haris Musthafa', '8281492771', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'cadwar', '$2y$13$gwSmWkKvh6A56xQ5gRWy/uVwpQiuzhlEMpQC.o.BK9Aqpv0A0KF.u', 'cadwar', 0, '');
INSERT INTO `events` (`event_id`, `cat_id`, `title`, `short_desc`, `details`, `min_memb`, `max_memb`, `venue`, `reg_fee`, `fee_type`, `prize`, `file1`, `file2`, `file_last_date`, `co1_name`, `co1_no`, `co2_name`, `co2_no`, `seats`, `reg_start`, `reg_end`, `username`, `pswd`, `link`, `is_certificate_pub`, `image_name`) VALUES
(63, 1, 'HACK-IT-RALPH', 'A deep technology 48 hour hackathon, in association with Microsoft.', '<p>Hack-it-Ralph is a deep technology hackathon. Problem statements will be given on the day of the hackathon, and participants have two days to build their own innovative solution to their chosen problem statements. Hack-it-Ralph is being conducted in association with with Microsoft, which will provide Azure accounts with 100$ in credit to the participants. The participants must use at least one Azure service in their product, along with any other tools they have. Azure services range from hosting, machine learning, blockchain platforms, serverless functions, among others.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Participants may form teams and a team may have a maximum of 5 members.</li>\r\n<li>Teams should be made up exclusively of students.</li>\r\n<li>All team members should be present at the event. Leaving the venue for some time to hack elsewhere is fine.</li>\r\n<li>Teams can gain advice and support from organizers, volunteers, sponsors, and others.</li>\r\n<li>The problem statements for the hackathon will be given at the start of the hackathon.</li>\r\n<li>The product must belong to at least one of the following areas : Artificial Intelligence, Blockchain, Internet of Things, Augmented Reality, Virtual Reality or Cybersecurity.</li>\r\n<li>All work on a project should be done at the hackathon.</li>\r\n<li>Teams can work on an idea that they have worked on before (as long as they do not reuse code).</li>\r\n<li>Contestants must use at least one service offered by the Azure platform in their project.</li>\r\n<li>Teams can use any libraries, frameworks, open-source code or electronic components in their projects in addition to at least one Azure service.</li>\r\n<li>Teams must stop hacking once the time is up.</li>\r\n<li>Teams can be disqualified from the competition at the organizers\' discretion. Reasons might include but are not limited to breaking the Competition Rules, or other unsporting behaviour.</li>\r\n<li>Participants may leave the premises any time during the hackathon, but must be present for the presentation.</li>\r\n</ul>\r\n<p><strong>Note: </strong>Lunch will be provided on 30th March.</p>', 1, 5, 'W310', 200, 'head', '15K', NULL, NULL, NULL, 'Parth Suresh', '9447787462', 'Hyzam Ali', '8138909122', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'hack_it_ralph', '$2y$13$UzkNcK6PPIlkpz0LD8zGge3RwYVnQDRpFmKFLPFHsOEsll4cgDM1a', 'hack_it_ralph', 0, ''),
(64, 4, 'ESPERANZA', 'A civil engineering surveying event.', '<p>Surveying to a civil engineering as a pen is to a writer. The art of surveying will always be etched in the heart of a civillion. Surveying skills truly measure up a civil engineer, and it is time they face the fire. Hestia &lsquo;19 brings to you Esperenza, the theodolite surveying where they open up hidden points from the clues given, and determine the area of the traverse using these points.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a minimum of 2 and a maximum of 4 participants.</li>\r\n<li>Participants must produce a valid college ID card.</li>\r\n<li>Cross college teams are allowed.</li>\r\n<li>Selection to the final round will be based on the performance in the preliminary round.</li>\r\n<li>All B.Tech, M.Tech and research scholars (18-27 age limit) are eligible to apply.</li>\r\n<li>Tools and equipments will be provided.</li>\r\n<li>All decisions of the organising committee is final and binding.</li>\r\n</ul>', 2, 4, 'Dynamics Lab', 200, 'team', '5K', NULL, NULL, NULL, 'Anandalekshmi A', '9495181099', 'Mehjabin M', '9567593456', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'esperanza', '$2y$13$KUTY98eNGo7bBY0nWWY8suxKip0BSZIRoKbE6imkWkVCiCAFXzNKm', 'esperanza', 1, ''),
(65, 4, 'THUMB RULES', 'An event which connects various survey fields.', '<p>Curious to know if the civil engineering skills in you is set for professional world? Experience a dose of real world scenarios and know where you stand in the world of surveying. Hestia &rsquo;19 presents THUMB RULES, an arena where your surveying skills will be measured and crowned. The event will consist of an aptitude test, followed by a set of tasks that will bring into limelight your expertise as a civil engineer.</p>\r\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Thumb Rules is a team event.</li>\r\n<li>A team can have a minimum of 2 and a maximum of 3 members.</li>\n<li>Eligibity to subsequent levels will be determined based on the performance in the preliminary round (Aptitude test).</li>\n<li>It will be better if you have a basic knowledge in AutoCad and Basics of Civil Engineering</li>\n<li>Spot registration is available</li>\r\n<li>Required instruments will be provided.</li>\r\n<li>All decisions made by the coordinators will be final.</li>\n<li>Winners will be selected based on the precision and accuracy of work accomplished.</li>\n<li>Maximum of three hours will be given for all the participants to complete the tasks.</li>\n<li>If no team complete the given task within the time limit, the percentage of task completed will be considered.</li>\n<li>Any kind of cheating will not be entertained and the guilty will be disqualified from the event.</li>\r\n</ul>', 2, 3, '', 100, 'head', '8K', NULL, NULL, NULL, 'Vijeesh K.P', '9947917995', 'Sneha S', '9037044191', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'thumb_rules', '$2y$13$frLhCKJjzgoDEqUQcHrftOdoVaYIs0tqiLeV5AwK62HY5ZEES.Czy', 'thumb_rules', 1, ''),
(66, 2, 'AURORA', 'What does the resilient world look like, how does it behave and most importantly, how do we design it?', '<p>Throughout history, natural disasters and extreme weather have always plagued cities across the world. However, over the course of the last decade, these effects have been magnified because of rapid climate change and global warming. Floods, earthquakes, typhoons, hurricanes, extreme drought and land subsidence have left many cities in shambles, communities in devastation, and millions of lives in bedlam. Besides these, deforestation, depletion of resources, disease outbreaks, civic and industrial pollution and social and economic instabilities have added to the woes of architects and city planners.</p>\r\n<p>The theme of &ldquo;Resilience Landscape&rdquo; could be interpreted as resilience of cities to natural disasters and/or exploration of the negative effectes of urbanisation. Participants are expected to address the issue by coming up with preventive, anticipatory, mitigatory or adaptive design solutions and propositions towards improving the resilience of cities through landscape architecture.</p>\r\n<p>The idea is to identify a suitable site, with a maximum area of 10000 sq. m, and propose the landscape design for the area, justifiable according to the brief. The design should be focused on empowering the local community and safeguarding the environment.</p>\r\n<p><strong>Rules and regulations:</strong></p>\r\n<ul>\r\n<li>Submissions are to be made before 29th March 2019.</li>\r\n<li>Submissions are to be done in A2 format.</li>\r\n<li>A maximum of 2 sheets are allowed per entry.</li>\r\n<li>Designs can be represented in the form of 2D and 3D graphics.</li>\r\n<li>Designs must have a close relation with the surroundings and user group.</li>\r\n<li>Entries can be an individual project or from a group of upto 3 members.</li>\r\n<li>Details of the participants should be mailed separately in pdf format along with the sheets.</li>\r\n</ul>\r\n<p><strong>Mode of submission:</strong></p>\r\n<p>The participants must register for the trophy through www.hestia.live, upon which a registration code will be provided. The registration code can be found on the event\'s tab once you login again. This entry code must be mentioned on the right-hand bottom corner of your sheet in a box. Any sheet that reveals the identity of your college is liable to get disqualified. The sheets must be sent to hiwagatkmce@gmail.com before 29/03/19.</p>', 1, 3, '', 200, 'team', '7K', NULL, NULL, NULL, 'Hadiya', '8943820919', 'Najila', '9746085873', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'aurora', '$2y$13$gwIvUDASVCPqNvVFk.X0L.AJ.cujgXol1LEI3I./VugSGWyl7Lvoy', 'aurora', 0, ''),
(67, 2, 'INVIGORATE', 'Modern buildings are challenging the conventional system and transforming from static to kinetic. The time has come to create dynamic spaces that will move the world around you.', '<p>Architecture has always been about science as much as it has been about design. The advancement in science has aided architecture to implement designs which were once considered crazy and impossible. The alchemy of science and design has given us modern and aesthetic structures that are functional and fresh.</p>\r\n<p>By incorporating motion in architecture, architects can create a sense of transition within the structure as well with the spaces, which lets the occupants interact with their surroundings, in a whole new dimension. Remember, the rolling bridge above Grand Union Canal? The structural marvel is a reminder that kinetic architecture in everyday design has the power to inspire, surprise and even touch the souls of the users and designers.</p>\r\n<p><strong>OVERVIEW OF THE THEME</strong></p>\r\n<p>The theme of kinetic architecture could be interpreted as an attempt to understand, define and frame a kinetic structure from a complex adaptive environment that aims to match the needs of the people on the inside while adapting to the elements on the outside.</p>\r\n<p>The idea is to design a theatre space that adapts to various special needs justifiable according to the brief. Participants are free to select the context, size and scale of the project.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>The submissions are to be made online before the 29th of March&rsquo;19.</li>\r\n<li>Submissions are to be done in A2 format.</li>\r\n<li>Maximum of 3 sheets are allotted per entry.</li>\r\n<li>A maximum of 5 participants per entry.</li>\r\n<li>Number of structures is limited to one.</li>\r\n<li>Sustainable/conservative nature should be analysed and briefed.</li>\r\n<li>Designs must have a close relation with the surroundings and user group.</li>\r\n<li>Site specifications and context must be clearly specified.</li>\r\n</ul>\r\n<p><strong>Mode of submission:</strong></p>\r\n<p>The participants must register for the trophy through www.hestia.live, upon which a registration code will be provided. The registration code can be found on the event\'s tab once you login again. This entry code must be mentioned on the right-hand bottom corner of your sheet in a box. Any sheet that reveals the identity of your college is liable to get disqualified. The sheets must be sent to hiwagatkmce@gmail.com before 29/03/19.</p>', 1, 5, '', 200, 'team', '10K', NULL, NULL, NULL, 'Siddharth', '6282679546', 'Devika ', '9744810088', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'invigorate', '$2y$13$JoOZz8uQNulUJk2.ldlDve.p6e4ghd4J7av.dUA5iCHHpQbDLVOHq', 'invigorate', 0, ''),
(68, 14, 'BADMINTON', '\"Only a shuttler knows how demanding the fastest sport in the world is.\"-Tiyasha\r\n', '<p>It\'s too fast and too furious. Get your quick reflexes out if you do not want to miss the shuttle. Let the feathers fly this badminton season at HESTIA \'19 as you serve it, smash it and win it. Don\'t be afraid to make a little \"racket\".</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Doubles partners should be from same institution.</li>\r\n<li>Participants should submit valid ID proofs.</li>\r\n<li>The event will be conducted in knockout format.</li>\r\n<li>The matches will be umpired based on BWF rules .</li>\r\n<li>All matches will be conducted using &nbsp;standard YELLOW MAVIS 350 shuttles</li>\r\n<li>Total prize money worth 6k will be awarded.</li>\r\n</ul>', 2, 2, 'Badminton Court', 300, 'team', '6K', NULL, NULL, NULL, 'Gautham', '9497075751', 'Fayis', '9544140958', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'badminton', '$2y$13$niBYBuu0z/TON2Y6.tjMXeLCpmP.VfIpp/yeRmBKCvcIOTmVBs8pu', 'badminton', 1, ''),
(69, 14, 'FOOTBALL', 'Feel the adrenaline pump through your veins as football beckons you at Hestia’19.', '<p>The time has come to get on the field. Pull out your socks and get ready to feel the adrenaline rush as the crowd roars for your goal. Eyes focused! It\'s right in front of you. Get the goal and feel the crowd rumble.Form your own trio and show them how it\'s played.</p>\r\n<p><strong>RULES &amp; REGULATIONS:</strong></p>\r\n<ul>\r\n<li>Maximum of 3 players (+3 rolling substitutes) per team.</li>\r\n<li>Match Duration: 20 minutes.</li>\r\n<li>The event will follow knockout format.</li>\r\n<li>Cross-college teams are allowed.</li>\r\n<li>Referee&rsquo;s decision will be final.</li>\r\n</ul>', 3, 6, '', 400, 'team', '10K', NULL, NULL, NULL, 'Gokul Ramesh', '9497837167', 'Raneesh', '9605638273', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'football', '$2y$13$eRzmbNtoEIqHWZK1g80XReIN2cmFmVLWXuiXHY1lEU65EUa/OxW9W', 'football', 0, ''),
(70, 14, 'BASKETBALL', 'Be prepared! Shoot the hoops and show them how it\'s played.', '<p>That\'s team Basketball and that\'s how team basketball should be played, it\'s selfless..guys move ,cut ,pass..dribble your ball towards the basket as the team has a fire but the best of 3 champions know when to ignite the spark!</p>\r\n<p><strong>RULES &amp; REGULATIONS:</strong></p>\r\n<ul>\r\n<li>Each team should consist of 4 members (3+1 Substitute).</li>\r\n<li>Field rules will be given to the team at the time of registration.</li>\r\n<li>Spot registration is allowed.</li>\r\n<li>Cross-college teams are allowed.</li>\r\n<li>All players should report with their college ID card.</li>\r\n</ul>', 3, 4, 'BasketBall Court', 300, 'team', '7K', NULL, NULL, NULL, 'Fazil', '8606509533', 'Shaz', '8138975831', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'basketball', '$2y$13$7QaMRITm6ydzPjqXZ7VhJ.4bw1A0Cw6BxffKEte1j0h3GCRfDbE66', 'basketball', 0, ''),
(71, 14, '30 Yard Softball Cricket', 'The pitch is set; gather your team for its time to smash the ball outside the stadium.', '<p>We can never have too much of cricket. One team, one fight. Bring out the sportsperson in you this summer at HESTIA \'19 as we get the field ready. The moment has come to either hit a six or take out a wicket. Let\'s hit the batting cages for some practice, shall we?</p>\r\n<p><strong>RULES &amp; REGULATIONS:</strong></p>\r\n<ul>\r\n<li>Maximum of 6 players (+one substitute) per team.</span></li>\r\n<li>Online and spot registrations available.</span></li>\r\n<li>All the teams should report to the registration counter at 8 o\'clock.</li>\r\n<li>The match will be of four overs and this will be a knockout tournament.</span></li>\r\n<li>One bowler can bowl only 2 over.</span></li>\r\n<li>Umpires decision is final.</li>\r\n<li>Coordinators can change the rules without prior notice.</span></li>\r\n<li> ID card is compulsory.</span></li>\r\n<li> First 32 teams are considered.</span></li>\r\n<li>Consult with the coordinators in need of any help during the competition.</li>\r\n<li>Boundary limit: 30 yard</li>\r\n</ul>', 6, 7, ' TKMCE CRICKET GROUND ', 500, 'team', '10K', NULL, NULL, NULL, 'Akhil Babu C', '9562675236', 'Salih', '9207616460', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', '30_yard', '$2y$13$lmYu6s91TyAbSu2nZrWcFe5AwVcDJblA8.Ktf9L2lgewujXa16LpG', '30_yard_softball_cricket', 0, ''),
(72, 14, 'VOLLEYBALL', 'Meet us at the nets and bring out your fists of fury.', '<p>Just two steps. Throw and smash! The moment has come to unleash the strength in your fists and guard your ground. Get your teams ready this month at HESTIA\'19 for the feistiest volleyball face-off ever seen. Let the game begin.</p>\r\n<p><strong>RULES &amp; REGULATIONS:</strong></p>\r\n<ul>\r\n<li>Individual rotations is not permitted (Still).</li>\r\n<li>Maximum 12 member squad.</li>\r\n<li>The event will follow knockout format.</li>\r\n<li>All matches will be best of three sets.</li>\r\n<li>Captains should report with their college ID Card.</li>\r\n<li>Referee&rsquo;s decision will be final.</li>\r\n</ul>', 6, 12, 'TKMCE VOLLEYBALL COURT ', 500, 'team', '10K', NULL, NULL, NULL, 'Ashim', '9995392446', 'Rohit', '9249347527', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'volleyball', '$2y$13$DKLs7zPSJrPKqJrN7Rh3kuT5o9M0fd1DRgG6oaOMf8UvP0tHPivnG', 'volleyball', 0, ''),
(73, 14, 'GAMBIT 2.0', 'Rattle your brains and let\'s battle it out.', '<p>Move in silence. Only speak when it\'s time to say checkmate. Gather your knights and bishops as we battle it out on the board. Make good moves and the game is yours. Get your thinking caps out at HESTIA \'19 as we play a game of chess</p>\r\n<p>&ldquo;Play the opening like a book, the middlegame like a magician, and the endgame like a machine.&rdquo; Do you have what it takes to be crowned as the ultimate chess wizard? Find out at Hestia \'19. Remember, all that matters on the chess board are good moves!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Tournament will be conducted according to the latest FIDE rules.</li>\r\n<li>Only college students are allowed to participate.</li>\r\n<li>Number of rounds and time limit will be decided according to the number of players registered.</li>\r\n<li>Players are requested to bring their own chess sets and clocks if available.</li>\r\n</ul>', 1, 1, '', 200, 'head', '20K', NULL, NULL, NULL, 'Akshay M', '7736791585', 'Hashrin', '7012971675', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'chess', '$2y$13$spIi1KiR1nSte7hTjJ8AeeZbcAAvRjYrhzHr.HuQYCp/5oVa4YsfW', 'chess', 1, ''),
(74, 15, '100 WORD TALE', 'To say more while saying less is the secret of the most simple and spectacular story', '<p>Are you a story writer struggling in the pangs of today\'s busy schedules? Do you put your ideas away for the burden of a long writing? Do you have what it takes to build up from nothing? Are you a smart worker than a hard one? Then this is the place to showcase your exceptional writing skills. Create your little story from your imaginations and let the world tell the stories of your creation.</p>\r\n<p><strong>RULES AND REGULATIONS:</strong></p>\r\n<ul>\r\n<li>The story must not exceed 100 words excluding the title</li>\r\n<li>Maximum of 45 minutes can be used including the prep time</li>\r\n<li>Topic will be given on the spot</li>\r\n<li>Let\'s play fair and square, use of mobile phones, tabs, smart watches etc during event will not be entertained</li>\r\n<li>Discussion among participants will not be entertained</li>\r\n<li>Story should be primarily in English although brief phrases from other languages are allowed.</li>\r\n<li>Decision of judges will be final and binding</li>\r\n</ul>', 1, 1, '', 50, 'head', '3K', NULL, NULL, NULL, 'Theertha C H', '9995137726', 'Sajan Babu \r\n', '9495312636', 0, '2019-03-15 00:00:00', '2019-03-30 00:00:00', '100_word_tale', '$2y$13$ZYjjomewlvWbfdyNiSivnu7otxC/BZQK1IGQl15PTejdqWWDGv7yy', '100_word_tale', 1, ''),
(75, 15, 'A STUDY IN SCARLET', 'A series of literary games.The game is afoot!\r\n', '<p>Rack your brain and furrow your brows.Delve deeper into the world of literature, and play the game of games. Battle your way through various rounds, beat enemies and find yourself in the last and final stage, where all you have to do is give us the answers we seek and victory shall be yours. The gentleman from 221B, Baker Street awaits to meet you at every step of the way.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Registration fee is 100 INR.</li>\r\n<li>Maximum of 2 members per team.</li>\r\n<li>Usage of phones during the competition is not allowed.</li>\r\n<li>Decisions made by the event coordinators will be final.</li>\r\n</ul>', 1, 2, '', 100, 'team', '5K', NULL, NULL, NULL, 'Namitha S Nair\r\n', '8281282819', 'Bianca', '6282440514', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'a_study_in_scarlet', '$2y$13$3Qo4wn5C4HO5tSa4zgwNWevlAriB/9szuKLvbqTCI5Ae0vRIMykXG', 'a_study_in_scarlet', 1, ''),
(76, 15, 'SPELL BEE', 'Arm yourself with the knowledge of a dictionary, for the team with the biggest vocabulary will bag the winning prize.', '<p>Spelling bee is a classic contest where participants are tested based on their vocabulary skills and knowledge in the English language. They are required to face a broad selection of puzzling words, which get more and more difficult with each round. Ultimately, the person who is a better speller, emerges the true sesquipedalian.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>The competition is open to all college students.</li>\r\n<li>All words will adhere to the Oxford Dictionary.</li>\r\n<li>The moderator will make every effort to pronounce the words right.</li>\r\n<li>The contestant may ask the moderator to repeat the word, define the word or include the word in a sentence.</li>\r\n<li>If a word has two or more homophones, the pronouncer will indicate which word is to be spelled.</li>\r\n<li>If the word dictated is unclear to a contestant, he or she may ask for the word to be re-pronounced, but will not be given a definition or a sentence.</li>\r\n<li>The competition consist of 3 rounds. First round will be a written test.</li>\r\n<li>The time given to spell a word will be 15 seconds for the second round and 10 seconds for the third round.</li>\r\n<li>If any participant is found to be indulging in unfair means to get an advantage, the team will be disqualified immediately.</li>\r\n<li>All participants must carry the ID cards of their respective college.</li>\r\n</ul>', 1, 2, '', 50, 'head', '3K', NULL, NULL, NULL, 'Shibila\r\n', '9497181334', 'Ijaz', '9446786841', 0, '2019-03-15 00:00:00', '2019-03-30 00:00:00', 'spell_bee', '$2y$13$DblBstSXc9dkkb1R4TfnB.acIkFs7kuSh6LQl3cCDcdv5rXYMQ.pK', 'spell_bee', 1, ''),
(77, 15, 'DEBATE', 'Discuss, debate and voice your opinions to put out the burning fires of dissent as you take to the stage at Hestia in the ultimate battle of wits and words.\r\n', '<p>History has testified that mere discussions aren\'t enough to light the fire of change. The confidence to stage your opinions as the only truth is the key to lead a diverse crowd through a common path.Do your words have enough power to put out the burning fire of dissent around? Is your voice strong enough to silence those mourners of doubt among the crowd?Then we should meet. The stage deserves you. Hestia\'19 welcomes you to the knock out with words- \' The debate\'.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Participate as an Individual or as a team of two.</li>\r\n<li>Medium of communication can be English or Malayalam.</li>\r\n<li>Topics will be announced on the spot.</li>\r\n<li>To speak affirmative or negative, will be decided by toss of the coin.</li>\r\n<li>4 teams will qualify into the final round.</li>\r\n<li>Indecent behaviour shall lead to disqualification.</li>\r\n<li>In case of any disputes, the decision of the coordinators will be final.</li>\r\n</ul>\r\n<p><strong>Prelims topic</strong>:<strong> \"</strong>Technology is destroying jobs in developing nations\".</p>', 1, 2, 'Workshop Block', 100, 'head', '8K', NULL, NULL, NULL, 'Bryan\r\n', '9495665561', 'Jefrin', '9446833009', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'debate', '$2y$13$7mQC7iyQgc2SCsLC6ydqEOQMEX057.QskF0XurUuCGP8aYVqFLAhC', 'debate', 1, ''),
(78, 15, 'TALK MAKER', 'The platform has been raised to flaunt off your skill with words.', '<p>Get your brains ticking for the round of JAM and then your creative juices flowing to loom your perfect story for BeATeller. Grip tight your vocabulary and confidence as they will be your only companions on your journey to be crowned as the ultimate \"Talk Maker-Hestia\'19\". Unleash the fire of words and forge your imprint during Hestia\'19.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>The event will be of 2 rounds. The first round will be a JAM and second will be a story telling.</li>\r\n<li>Further details will be announced at the start of the event.</li>\r\n</ul>', 1, 1, 'Workshop Block', 50, 'head', '3K', NULL, NULL, NULL, 'Safin\r\n', '9747558475', 'Anagha', '8547371644', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'talk_maker', '$2y$13$s6iFszEwoSs4AnbWtqde6.UXwyrmxkBvP80KOSS4mFFJ4IX1YAtAK', 'talk_maker', 1, ''),
(79, 18, 'HIVEMIND', 'Man\'s craving for new things is beyond parallel.', '<p>Curiosity has been man\'s best friend for ages and quizzing has remained his favourite sport. This Hestia, we host our Annual Open General quiz \'Hive Mind\' in association with TKMCE Quiz Club. The quiz will be hosted by the illustrious Major Chandrakant Nair and there is a whopping 12k worth prize money to be won!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Hivemind is an open general quiz.</li>\r\n<li>A team can have a maximum of 3 members. Lone wolves are also permitted.</li>\r\n</ul>', 1, 3, 'APJ Hall', 100, 'head', '12K', NULL, NULL, NULL, 'Rasal', '7012444128', 'Sarath', '9562021384', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'hivemind', '$2y$13$ncnvuaCxuc1VCvTVDyM.QO8/joU6bBM/8KdqZxL3RchkgSKrna2hi', 'hivemind', 1, ''),
(80, 18, 'CULT', 'The world will know your name if you can sport or entertain.', '<p>Sports and Entertainment has been two of the most influential area of human knowledge. Some of the most iconic actors and footballers are more engraved into human minds than world leaders. This Hestia, we celebrate your wits of knowledge on being sporty and entertaining under \'Cult\'. Cult is a campus Spent quiz hosted by the ever enlightening Major Chandrakant Nair. Get ready for kickoff as the clapboard is ready to take the shot. Cult is ready for you, are you?</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Cult is a campus spent quiz.</li>\r\n<li>Teams of three.</li>\r\n<li>Lone wolves are allowed</li>\r\n<li>Cross college teams are allowed.</li>\r\n</ul>', 1, 3, 'APJ Hall', 100, 'team', '6K', NULL, NULL, NULL, 'Keerthana', '8281186015', 'Anekha', '9495293242', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'cult', '$2y$13$IjBtlaVwslST8lzCm9OYhuzh0lsjtQgwvs0q/FtItyYFSPKWEMXcu', 'cult', 1, ''),
(81, 18, 'Mr. Or  Ms. HESTIA', 'The quest to find the real king or queen of Hestia is on.', '<p>The quest to find the real king or queen of Hestia is on. Make your mark as you stride across the levels and proclaim that you are a true specimen to be crowned as Mr/Ms.Hestia.</p>\r\n<p>Hestia&rsquo;19 hosts Mr or Ms Hestia: A battle to find the psyche driven by strength and vitality; A battle to find the &lsquo;original&rsquo;.</p>\r\n<p>&ldquo;Appearances make impressions but it is the personality that makes an impact&rdquo;. Dare to show off your vibrant personality,talent and charm; Dare to join!!.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>There is no limit to the number of participants from the same college.</li>\r\n<li>All participants will have to undergo a preliminary screening round.</li>\r\n<li>An appropriate number of candidates who clear the prelims, will be selected for the final round, which will be held mainstage.</li>\r\n<li>The finalists will be chosen regardless of the gender.</li>\r\n<li>There will only be one first prize, irrespective of gender.</li>\r\n<li>Any offensive or disrespectful behaviour towards the hosts, judges or audience will not be tolerated and may lead to disqualification.</li>\r\n<li>The judge\'s decision will be final.</li>\r\n</ul>', 1, 1, 'Auditorium', 300, 'head', '30K', NULL, NULL, NULL, 'Hiba Hashim', '8943538059', 'Sreeraj R', '7559964876', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'mr_or_mrs_hestia', '$2y$13$tdYQHg6NjeCpLCugeJrzbuB1fxSc6EDBj42F7PsjehXId27ar4cJ6', 'mr_or_mrs_hestia', 1, ''),
(82, 16, 'PROCESS DESIGN ENGINEERING USING ASPEN HYSIS', 'Have you ever explored the possibilities of visualising and simulating the industrial equipments in a chemical plant or a petroleum refinery?', '<p>Hestia \'19 presents \"PROCESS DESIGN ENGINEERING USING ASPEN HYSIS\", one of a kind workshop for the chemical enthusiasts out there!</p>\r\n<p>Process Design Engineering workshop focuses on Process Equipments, Layout, Piping Design, and Plot Plans &amp; Isometrics for Process Plant Engineering conceptualized by the top industry professionals in association with Innovians Technologies to groom the engineers in the field of Process Design. The workshop is strictly based on Aspen Hysis, which is a renowned industrial software for process designing.</p>\r\n<p><strong>Highlights:</strong></p>\r\n<ul>\r\n<li>Certificate of merit from TECHNEX \'19, IIT Varanasi will be provided to all the participants.</li>\r\n<li>A chance to interact and learn from experts in the domain.</li>\r\n</ul>\r\n<p><strong>Eligibility: </strong></p>\r\n<p>&nbsp; &nbsp; &nbsp;Basic knowledge in Chemical Engineering.</p>\r\n<p><strong>Rules And Regulations :</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp;Participants can register individually or as a team of two.</p>\r\n<p><strong>Takeaways:</strong></p>\r\n<p>&nbsp; &nbsp; &nbsp;Authorized certificates, study materials and software packages.</p>', 1, 1, '', 900, 'head', '', NULL, NULL, NULL, 'Vivek', '8089836121', 'Sreehari', '8848660827', 100, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'process_design', '$2y$13$PT21i1/nOwgrd/7OyrEoe.TtgrjTlqaRVP50RMrbKgUJqkvWRbvHu', 'process_design_engineering_using_aspen_hysis', 0, ''),
(83, 5, 'Poseidon (Paper Presentation)', 'To bring out the real, original ideas.', '<p>The Paper presentation contest of HESTIA\'19 aims at tapping this infinite potential of the human mind discovery. We invite you to bring forth such original ideas and present it in a genuine and comprehensive way.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>The competition is open to undergraduate students of all disciplines.</li>\r\n<li>The Paper should follow a standard IEEE format.</li>\r\n<li>Each team may have a maximum of 4 members.</li>\r\n<li>Teams will get 15 minutes for presentation followed by a Q&amp;A session.</li>\r\n<li>Certificates will be issued to every participant.</li>\r\n<li>Abstract of 100 words and Paper should be submitted after registration.</li>\r\n</ul>\r\n<p>The paper should be based on <strong>Emerging Technologies</strong>.</p>\r\n', 1, 4, '', 200, 'team', '8K', 'Link to Paper', 'Link to abstract', '2019-03-29', 'Hubail', '9656383100', 'Fasila Ruksana', '9747081416', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'poseidon', '$2y$13$33I2O6GFPwz0zyZvN38e7OtaPsU8rYQEmedUE3Wh1QkGCjmdKYSOG', 'poseidon', 1, ''),
(84, 16, 'Underwater Robotics', 'An Underwater Robotics workshop with the objective to quench the thirst of young engineers to discover what lies beneath the water and why is it difficult to navigate inside water.', '<p>\"The best way to observe a fish is to become a fish\"</p>\r\n<p>Underwater robotics is the key technology in future ocean exploration and utilization. Subsea oil and gas factories, exposed aquaculture and deep sea mining are currently the main drivers for development in underwater robotics.</p>\r\n<p>Would you like to dive deeper into the oceans and discover the marvel of the life beneath? Introduce yourself to the world of various mechanism considering the modularity and hydrodynamics of water vehicles including Autonomous Underwater Vehicles(AUV\'S).</p>\r\n<p>Enrol yourself in the Underwater Robotics Workshop conducted in accordance with Hestia 2019!</p>\r\n<p><strong>Highlights:</strong></p>\r\n<ul>\r\n<li>Certificate of excellence will be awarded to the attendees in association with IIT Delhi.</li>\r\n<li>Take away kit will be provided for a team of 4.</li>\r\n</ul>', 1, 1, '200', 1200, 'head', '', NULL, NULL, NULL, 'Don Kurian', '9497017556', 'Sreeson', '9633891736', 104, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'underwater', '$2y$13$Vv9VPDj1EkPfBW2V3XTH.eKZb4Cg8SVDwuHRpf9.xCqeHINsmol9S', 'underwater', 0, ''),
(85, 16, 'Embedded Systems using Texas Instruments Microcont', 'Embedded system is one of the most important, yet overlooked subjects in the electronics world.', '<p>Hestia\'19 presents to you a workshop on \"Embedded Systems using Texas Instruments Microcontroller\".</p>\r\n<p>This workshop offers an introduction to \"Embedded System Design\" and is based on the advanced development tool from Texas Instruments. The TIVA-C Launchpad offers a complete Embedded System Design solution.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<p>Participants should form a group of three and each group should have a laptop(Windows 7 Or higher).</p>\r\n<p><strong>Highlights:</strong></p>\r\n<p>Certification from Texas Instruments.</p>', 1, 3, 'Architecture Hall', 900, 'head', '', NULL, NULL, NULL, 'Anupama P C', '9961098840', 'Nithin Baby', '8281267758', 32, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'embedded_system', '$2y$13$llm6ED0.bLE6V5k0iKTJrOIQczu3T4uZvvxRxZV38itrWvja3.yxS', 'embedded_system', 0, ''),
(86, 2, 'Doodlebug- Doodling', 'Have an irresistible mind and chaotic ideas?', '<p>Have an irresistible mind and chaotic ideas? Hiwaga\'19 invites you to fill the papers with weirdy nerdy doodles.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n  <li>This is an Individual event.</li>\r\n<li>Time duration for the event is 1 hour.</li>\r\n<li>Topic will be given on the spot.</li>\r\n<li>Paper will be provided at the venue.</li>\r\n<li>Participants are expected to carry their own pens</li>\r\n</ul>', 1, 1, '', 50, 'head', '2K', NULL, NULL, NULL, 'Aishwarya', '9497606691', 'Amala', '9605939683', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'doodlebug', '$2y$13$sU4DiV0fGZS062i.zwgVZOJTx4VtYIZhxN7K.9/zWydzMV/uGo8Mq', 'doodlebug', 0, ''),
(87, 2, 'Trash can trash can', 'Making trash cans out of trash', '<p>It is called \"trash can\" not \"trash cannot\". So grab all the trash you can find and ignite your imagination to make the best trash can out of it!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Each team shall consist of two members.</li>\r\n<li>Participants will be allotted 1 hour of time.</li>\r\n<li>Participants are expected to bring all required materials.</li>\r\n</ul>', 1, 2, '', 50, 'team', '2K', NULL, NULL, NULL, 'Jisty Thomas', '8075767578', 'Nazneen Najeeb', '8921200911', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'trash_can', '$2y$13$lqMP7KUtWHl5Pm3L9YofZ.hQWCRRpzU9nDYUmU/AMCIN00/6oYdFm', 'trash_can', 0, ''),
(88, 2, 'Sketchup-Pictionary', 'Do you have the fastest hand in the wild west?', '<p>Do you have the fastest hand in the wild west? Think you know your architecture lingo? Prove it! &nbsp;&ldquo;Sketch-up&rdquo; with lightning speed in tests that will make you rethink how fast you can create-and think-under pressure!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Each team shall consist of two members</li>\r\n<li>5 rounds of varying difficulty and challenges.</li>\r\n<li>Architecture related words too are included.</li>\r\n  <li>Markers and other Necessary items will be provided.</li>\r\n</ul>', 1, 2, '', 100, 'team', '2K', NULL, NULL, NULL, 'Mitha', '9496693587', 'Gokul', '9495967879', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'sketchup', '$2y$13$CVRvfw.2XQBuv4LVvu8msug1H67yATrm6/VNKjv5Yshz75.J3nMUC', 'sketchup', 0, ''),
(89, 2, 'MIMICONCEPT - On spot model making competition', '\"Its fun to do the impossible\"- Walt Disney', '<p>Build your imagination with planes and express it with your emotions. Let loose the \"Walt Disney\" in you.</p>\r\n<p>Comic strip or mimicry but don\'t let out your tongue.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Each team shall consist of 2-3 members.</li>\r\n<li>Duration: 3 hours.</li>\r\n<li>Participants should present the design concept of their model through a comic strip or &nbsp;mini-skit.</li>\r\n<li>Participants will be provided with the basic materials for the model.</li>\r\n<li>Participants are expected to bring other required stationeries.</li>\r\n</ul>', 2, 3, '', 150, 'team', '2K', NULL, NULL, NULL, 'Julia', '8281558048', 'Sandra', '9207025727', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'mimiconcept', '$2y$13$gFnvZvNYPYjazAWWphrncuZVQgWzF2wCmXTahGK3IOenKEuVjjO0q', 'mimiconcept', 0, ''),
(90, 2, 'ENTWINED - Transform your creativity into 3D', '\"In the midst of chaos lies creativity.\"', '<p>Get those creative ideas flowing. Free your imagination and transform your creativity into 3D. Mould, twist and shape your thoughts using wires and pliers. Let it be unique and yet identifiable for others.</p>\r\n<p>RULES AND REGULATIONS:</p>\r\n<ul>\r\n<li>Team can have maximum 2 members.</li>\r\n<li>All required materials will be provided in limited quantity.</li>\r\n<li>Participants may only use materials provided.</li>\r\n<li>Prefabricated sculptures are not allowed.</li>\r\n<li>On the spot topics will given.</li>\r\n<li>Participants will be allowed 1.5 hours of time.</li>\r\n</ul>', 1, 2, '', 100, 'team', '2K', NULL, NULL, NULL, 'Synan', '8943070428', 'Christina', '8075197948', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'entwined', '$2y$13$8oaYT5KbYofycrGPQonGw.VeZcqT9PAtppoN1Qw5wXn8iHqgllgZG', 'entwined', 0, ''),
(91, 2, '‘PAPER’AZZI', 'The paper fashion event.', '<p>&ldquo;Fashion is about suspense, surprise and fantasy; not about rules.&rdquo; Grab some papers to enter the alluring world that brings out the fashionista in you. Hestia &lsquo;19 presents &lsquo;Paper&rsquo;azzi, the ideal platform to merge your creativity, talent and style quotient.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>A team can include a model and a designer.</li>\r\n<li>Participants will be allotted a total of 2.5 hours of time.</li>\r\n<li>Topic will be given on the spot.</li>\r\n<li>Paper and other necessary equipments will be provided at the venue.</li>\r\n</ul>', 3, 4, '', 100, 'team', '3K', NULL, NULL, NULL, 'Arpita', '9061984375', 'Maria', '9048235458', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'paperazzi', '$2y$13$OHaJ9xuGyYpgDa/zhiP5GekHLzlXfDxov4vfX9W4acR123QtekeBe', 'paper_azzi', 0, ''),
(92, 1, 'Capture the Flag', 'Get ready to exploit vulnerabilities, create backdoors and prove that you are the ultimate hacker!', '<p>Get ready to exploit vulnerabilities, create backdoors and prove that you are the ultimate hacker! HESTIA \'19 presents Capture the Flag, a cybersecurity event where you test your hacking skills and out-of-the-box thinking by solving a series of questions related to exploiting vulnerabilities in the given code. So put on your anonynous masks and get ready to hack your way to the top.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>A team can have 1 or 2 members.</li>\r\n<li>Internet access will be provided</li>\r\n<li>Password for decrypting the next challenge will be the flag of the previous challenge. After you have got the flag, please inform the volunteers.</li>\r\n<li>You can use telnet or netcat to connect to challenge server if necessary.</li>\r\n<li>Restrict your attempts to find vulnerabilities to the challenge server only. Attempting to gain access to any other systems during the competition will lead to disqualification of the team.</li>\r\n<li>The event will span over a total time of 3 hours.</li>\r\n</ul>', 1, 2, '', 100, 'team', '10K', NULL, NULL, NULL, 'Parth', '9447787462', 'Abhiram', '8848497224', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'capture_the_flag', '$2y$13$E6YHV/LUmd3pxTSkeaPef.uRbdg6GIPLHfb.OdjBrr3zbBwNRAo4K', 'capture_the_flag', 0, ''),
(93, 1, 'Sanfoundry Certification Test', 'Python Programming Certification Test', '<p><strong>Python Programming Certification Test Details</strong></p>\r\n<ul>\r\n  <li>50 multiple choice questions: to be completed in 1 hour</li>\r\n  <li>Correct answer:2 marks, Wrong Answer: -1 mark</li>\r\n</ul>\r\n<p>\r\n  <strong>Python Programming Certification Test Benefits</strong>\r\n</p>\r\n<ul>\r\n  <li>Student scoring Grade A* or A will be given &quot;Certificate of Merit&quot; from Sanfoundry.</li>\r\n  <li>The Topper with A*/A grade in the Python programming certification test will be automatically shortlisted for doing Internship at Sanfoundry. Remaining students with A*/A grades will be given a preference if internship positions are available.</li>\r\n</ul>\r\n<p>\r\n  <strong>Internship Opportunities at Sanfoundry</strong>\r\n</p>\r\n<ul>\r\n  <li>Content Developer: Shortlisted interns are going to create either &quot;1000 MCQs (Multiple Choice Questions &amp; Answers)&quot; OR &quot;150 Programs/Algorithms&quot; OR &quot;100 Tutorial Articles&quot; in the chosen area.</li>\r\n  <li>Content Writer: Shortlisted interns are going to create &quot;100 Articles&quot; in areas such as education, examination, companies, and PSUs.</li>\r\n  <li>Programmer: if you are passionate about coding and have been coding tirelessly for years, then this internship opportunity will suit you.</li>\r\n</ul>\r\n<p>\r\n  <strong>Stipend:</strong>\r\n</p>\r\n<p>After completion of the internship,Interns will be awarded an Internship Certificate and a cash reward of 2500 INR. If the timeliness and quality of your submission is very good, there will be an additional cash reward of 2500 INR, thereby making a total of 5000 INR. Most of our past interns are from IITs, NITs and IIITs.</p>', 1, 1, '', 0, 'head', NULL, NULL, NULL, NULL, 'Amal Roy', '9496971997', 'Preethi Ann Jacob', '9495256127', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'sanfoundry', '$2y$13$92.Xz5t.0pu61Hp7ogu18uaZroNmB6vKi0CJ1q2CPRsMgNLYEwn/C', 'sanfoundry', 0, ''),
(94, 18, 'GAME OF CLUES', '“When you play the game of thrones, you win or you die.”', '<p>History is all around and you could be one of the lucky few to live in it. Come, team up, fight the houses, saddle up your brains to conquer the empire! Unravel the secrets, open your senses and march to the treasure. Hestia brings you Game of Thrones themed AR Treasure Hunt.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>A team can have a maximum of 4 participants.</li>\r\n<li>Each team must have at least one android device with internet connection.</li>\r\n<li>This is a one-day event.</li>\r\n<li>The theme of the event is Game of Thrones.</li>\r\n<li>The Coordinators&rsquo; decision shall be final.</li>\r\n</ul>', 1, 4, '', 100, 'head', '10K', NULL, NULL, NULL, 'Sreerag S', '8086476599', 'Shaun Thayil', '8593815355', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'game_of_clues', '$2y$13$CKI40kz2L0U31YMPRuG0CeG.sk6VgzWk1E/jO5vOvT/sMCqkUkH62', 'game_of_clues', 1, ''),
(95, 19, 'CALL OF DUTY', '\" Stay low,Go fast\r\nKill first, Die last\r\nOne shot, One kill\r\nNo luck, All skill.\"', '<p>Hestia\'19 brings you Call of Duty, Modern warfare 3 with prizes worth 6k!</p>\r\n<p>Feel the adrenaline rush through your body when you and your team knock out the world and rise beyond the ashes.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>Initial stages: FPS Team death match.<br />Final stage: Best of three matches.</li>\r\n<li>Each team should consist of 5 players.</li>\r\n<li>Cheating of any kind will not be tolerated.</li>\r\n<li>Group rounds will depend upon number of participants.</li>\r\n<li>Coordinators will have full authority to disqualify participants in case of any violation of rules and in case of disputes coordinators\' decision will be final and binding.</li>\r\n</ul>', 5, 5, '210', 100, 'team', '6K', NULL, NULL, NULL, 'Anirudh C E', '8281531388', 'Joseph', '8281749140', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'call_of_duty', '$2y$13$6hGCtPdNIM7x0fcudwB1CewVc009MK8cNJHGKD0/.gvIbH6UWC4mS', 'call_of_duty', 0, ''),
(96, 19, 'FIFA 18', '\"Risk Everything to Win Everything!\"', '<p>Pull up a sombrero, nutmeg your opponent and showcase your dribbling skills in the ultimate battle of footballing titans.</p>\r\n<p><strong>TYPE:</strong> Individual</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ul>\r\n<li>It is a multiple round knockout event (1 VS 1).</li>\r\n<li>The first round will be played by all the registered users.</li>\r\n<li>The winner of every round progresses to the next knockout round.</li>\r\n<li>Opponents will be chosen randomly.</li>\r\n<li>At any point in the tournament the organizer/coordinator has the right to dismiss the match and disqualify a player in case of foul play.</li>\r\n<li>A match will last for 10 minutes (Half-time: 5 mins) for all the knockout rounds, except the SEMI- FINALS and FINALS where the match length will be 12 minutes (Half-time: 6 mins).</li>\r\n<li>The GAME DIFFICULTY and the GOAL KEEPER level will be set to \'World Class\' for the whole of the tournament.</li>\r\n<li>If the winner is not decided in normal time (10 min for initial rounds and 12 min in case of semi\'s and finals), then extra half of play time will decide the winner, if there is a draw, the golden rule will be applied wherein the first participant to score wins the tie.</li>\r\n<li>Participants will be given 4 minutes before every match to configure their controls according to their needs.</li>\r\n<li>&nbsp;Participants who do not arrive in time will be disqualified for the next round.</li>\r\n</ul>', 1, 1, '', 100, 'head', '5K', NULL, NULL, NULL, 'Roshan', '7012722529', 'Nishad', '9526229204', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'fifa_18', '$2y$13$TmVWnqGlFsKWE0sNiGhfLeAGURRyQdA7Fn.r1eAbDcxz3W2q6Pk8m', 'fifa_18', 1, ''),
(97, 16, 'PAPERTUBE WORKSHOP', 'Sustainability is no longer about doing less harm, but it is about doing more good.', '<p>Isn&rsquo;t it high time that we think of some panacea to bring back the pristinity of nature? Let\'s look into ways that bring about Sustainability. Hestia \'19 provides you with the opportunity to find paper as a remedy to tackle the issues of the environment.</p>\r\n<p>Papertube Workshop paves the way to use paper as a building material and focuses on various design possibilities from scraps of paper. Workshop includes prototyping with live installation within the campus and form-finding by physical modelling. The most difficult thing is the decision to act, the rest is merely tenacity. So, grab your opportunity to find the new dimensions of sustainable building practices.</p>\r\n<p><strong>Tutor details:</strong> Ar.Sharan Krishnan, Ar. Aleena Xavier and Ar. Kalyani.</p>', 1, 1, '', 50, 'head', NULL, NULL, NULL, NULL, 'Sumith', '9633545486', 'Fathima', '8606890777', 45, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'paper_tube', '$2y$13$zKRgV1jFPxLoMamOsJlBf.s246SaH6VGG9M64vWe.uCAIpYinn7S6', 'paper_tube', 1, ''),
(98, 16, 'BAMBOO WORKSHOP', 'In Daniel Defoe\'s novel, Robinson Crusoe, the protagonist of the book survives almost solely on one of the most trusted materials known to man. Bamboo.', '<p>It is a cornerstone in the field of construction. To understand the intricacies behind this magical material is a tedious task. As part of Hestia \'19, we are organizing a 2-day workshop on Bamboo.</p>\r\n<p>Through the workshop, participants will gain an in-depth knowledge about the history of bamboo and its earlier uses.</p>\r\n<p>Bamboo is one of the oldest building materials and the workshop will discuss in detail the different joineries and connections of bamboo construction.</p>\r\n<p><strong>Tutor details:</strong></p>\r\n<p>RISHAB KUNDRA :&nbsp;ark studio (<a href=\"http://www.arkstudios.in/\">www.arkstudios.in</a>)</p>', 1, 1, 'Multi-purpose Studio', 200, 'head', NULL, NULL, NULL, NULL, 'Basim', '9497296368', 'Navneeth', '9400714162', 52, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'bamboo', '$2y$13$jZWrEe.vuGfXgPsRWu47GeNrUlJrKS0rfV6yaHeE1gdlkZlhdNdVS', 'bamboo', 1, ''),
(99, 16, 'PORTFOLIO AND PRESENTATION WORKSHOP', '\"The brain doesn\'t pay attention to boring things. \"', '<p>On that note, Hestia \'19 brings to you a portfolio making and presentation workshop. Get a heads up on your presentation skills and make a great first impression!</p>\r\n<p>Participants will be able to understand various presentation techniques and make efficient usage of softwares to make the portfolio interesting by attending this workshop.</p>\r\n<p>Participants must bring laptops with Adobe Photoshop/PowerPoint.</p>\r\n<p><strong>Tutor details :</strong></p>\r\n<p>Sahir Mohammed</p>', 1, 1, '', 50, 'head', NULL, NULL, NULL, NULL, 'Aysha', '7012831313', 'Priya', '9495611820', 53, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'portfolio', '$2y$13$ucgPdl/T6Q8NYtSmcHI/tuUOJpMZpoCMMf2up6JFElUagAbvAv2bK', 'portfolio_presentation', 1, '');
INSERT INTO `events` (`event_id`, `cat_id`, `title`, `short_desc`, `details`, `min_memb`, `max_memb`, `venue`, `reg_fee`, `fee_type`, `prize`, `file1`, `file2`, `file_last_date`, `co1_name`, `co1_no`, `co2_name`, `co2_no`, `seats`, `reg_start`, `reg_end`, `username`, `pswd`, `link`, `is_certificate_pub`, `image_name`) VALUES
(100, 19, 'PUBG Solo', 'It\'s time for PUBG! A chance for you to prove your shooting skills and win exciting prizes!!', '<p>Watch your step and your aim because Pochinki is calling out to you!</p>\r\n<p>Put on your armor, Pick up your weapon and Come out of your safe house!</p>\r\n<p>Hestia\'19 presents the biggest &nbsp;PUBG tournament!</p>\r\n<p>Battle it out amongst the finest players for the ultimate chicken dinner!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ol>\r\n  <li>No emulators.</li>\r\n  <li>No hacks allowed.</li>\r\n  <li>Teaming up will result in disqualification.</li>\r\n  <li>Physical presence is compulsory for SOLO.</li>\r\n  <li>Game mode: TPP only.</li>\r\n  <li>For Solo : <br> Mode : Classic<br>Map : Sanhok</li>\r\n  <li>Coordinators will have full authority to disqualify participants in case of any violation of rules.</li>\r\n</ol>', 1, 1, '209', 30, 'head', '2K', NULL, NULL, NULL, 'Gowrisankar', '9497272417', 'Arjun', '9745069290', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'pubg_solo', '$2y$13$axdGNM8z34pxNprlWDkajOMSqv16CCc5FGyweSyPYuAE9Ks8Fiuku', 'pubg_solo', 0, ''),
(101, 19, 'PUBG Squad', 'It\'s time for PUBG! A chance for you to prove your shooting skills and win exciting prizes!!', '<p>Watch your step and your aim because Pochinki is calling out to you!</p>\r\n<p>Put on your armor, Pick up your weapon and Come out of your safe house!</p>\r\n<p>Hestia\'19 presents the biggest &nbsp;PUBG tournament!</p>\r\n<p>Battle it out amongst the finest players for the ultimate chicken dinner!</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ol>\r\n<li>No emulators.</li>\r\n<li>No hacks allowed.</li>\r\n<li>Teaming up will result in disqualification.</li>\r\n<li>Group rounds will depend upon the number of participants.</li>\r\n<li>At least one member should be physically present for SQUAD category.</li>\r\n<li>Game mode: TPP only.</li>\r\n<li>For Solo : <br /> Mode : Classic<br />Map : Erangel</li>\r\n<li>Coordinators will have full authority to disqualify participants in case of any violation of rules.</li>\r\n</ol>', 4, 4, '209', 100, 'team', '3K', NULL, NULL, NULL, 'Gowrisankar', '9497272417', 'Arjun', '9745069290', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'pubg_squad', '$2y$13$axdGNM8z34pxNprlWDkajOMSqv16CCc5FGyweSyPYuAE9Ks8Fiuku', 'pubg_squad', 1, ''),
(102, 19, 'Sombrero Solo', '\"What if playing football on the phone, often considered a practice of unproductive tinkering, brings you prestige?\"', '<p>Hestia 19\', the national level techno cultural festival of TKMCE presents the PES tournament for all its fanatics out there. So come, kick hard and take away the reward along with the pride of being a gamer.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ol>\r\n  <li>Team strength difference must be less than 300.</li>\r\n  <li>Only 3 featured players are allowed per team.</li>\r\n  <li>For SOLO, 32 players group knock out tournament (numbers may change based on participants)</li>\r\n</ol>', 1, 1, '', 30, 'head', '2K', NULL, NULL, NULL, 'Vysakh', '9447144435', 'Thomas', '8714414525', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'sombrero_solo', '$2y$13$sc/8Kv5c7UCfMvzsywzJpeVCHoBY.XrMCU3fos5/zLl7dJGdXSlaC', 'sombrero_solo', 0, ''),
(103, 19, 'Sombrero Squad', '\"What if playing football on the phone, often considered a practice of unproductive tinkering, brings you prestige?\"', '<p>Hestia 19\', the national level techno cultural festival of TKMCE presents the PES tournament for all its fanatics out there. So come, kick hard and take away the reward along with the pride of being a gamer.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ol>\r\n<li>Only 3 featured players are allowed per team.</li>\r\n  <li>For SQUAD<br>Team strength category:<br>Player 1 :Strength 2700-2800<br>Player 2: Strength 2800-2900<br>Player 3: Strength 2900-3000<br>Player 4: Strength 3000 above.</li>\r\n</ol>', 4, 4, '', 100, 'team', '3K', NULL, NULL, NULL, 'Vysakh', '9447144435', 'Thomas', '8714414525', 0, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'sombrero_squad', '$2y$13$sc/8Kv5c7UCfMvzsywzJpeVCHoBY.XrMCU3fos5/zLl7dJGdXSlaC', 'sombrero_squad', 0, ''),
(104, 18, 'How you doin?', 'Show that you are a real fan!', '<p>So no one told you life was gonna be this way...</p>\r\n<p>Who can\'t relate to this line of the theme to F.R.I.E.N.D.S ? And who can\'t relate personally to at least one Friend - and to the tricky, sticky situations they always seem to land themselves in? We know you\'re a huge fan. Lot of them out there.</p>\r\n<p>So, better get started, Friends superfan! Tell us, \"Who Said It?\" Or, see if you can remember the Friends pilot episode well enough to ace the quiz about it. Or, impress us with how much you know about Chandler\'s job. Try a few quizzes right now! And if you want, challenge your own friends to beat your scores.</p>\r\n<p><strong>Rules and regulations</strong></p>\r\n<ol>\r\n  <li>A team can have a maximum of two members.</li>\r\n  <li>No references and internet are allowed.</li>\r\n</ol>', 1, 2, '', 100, 'team', '4K', NULL, NULL, NULL, 'Akshay Aravind', '9567153044', 'Snigda Suresh', '7025820644', 46, '2019-03-15 00:00:00', '2019-03-30 00:00:00', 'how_you_doin', '$2y$13$mnx9m.sloLK5P0nSy3m3Yewz3M4ILHCv4s2legwicwnwe6nCeFIpq', 'how_you_doin', 0, ''),
(105, 4, 'Dr. CIVIL', 'To find out the team which has inexplicable passion in diverse areas of civil engineering.', '<p>Are you confident enough to call yourself a civil \'physician&rsquo;? We\'ve got the symptoms and the problems, and we do need your prescription!</p>\r\n<p>We&rsquo;re on the way to finding out the best civil engineers who can find art in every architecture. Hestia &lsquo;19 presents, Dr. Civil, a platform to showcase your inexplicable passion in diverse areas of Civil Engineering. This is where your managerial, technical and logical skills get tested through a spectrum of contests, in addition to rating you as a Civil Engineer!</p>\r\n<p><strong>Event Layout:</strong></p>\r\n<p>The first round will be an aptitude test, and only those participants who clear the prelims will be eligible for the higher rounds. The details of higher rounds will be disclosed only after the commencement of the events</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ol>\r\n<li >A team can have a maximum of 3 participants.</li>\r\n<li >All necessary materials will be provided.</li>\r\n<li >Mobile phones will not be permitted unless otherwise specified.</li>\r\n<li >All decisions by the judges and organisers will be final.</li>\r\n</ol>', 1, 3, 'M412,M411', 200, 'team', '8K', NULL, NULL, NULL, 'Abhin Paul', '9605577123', 'Navvar', '8281568322', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'dr_civil', '$2y$13$cLDPBwEMcENIRQta2xaoh.0nwIPRLVIizphIfX5BYe1T6rZzLS0e.', 'dr_civil', 1, ''),
(106, 4, 'STHAPATI', 'Are you a passionate Sthapati? Do you dare to fight the tremors?', '<p>Storm your brain, clink your arm and erect an earthquake resistant building. Mashup your teamwork and spontaneity to fascinate us with limited resources. HESTIA &lsquo;19 provides the stage to put your practical skills to the test! Come, mould and construct an indestructible building.</p>\r\n<p><strong>Event Layout:</strong></p>\r\n<p>The event will consist of two rounds. The first round will be an aptitude test. The second round will be a designing challenge and will test the proficiency of participants in structural and earthquake engineering. The first and second rounds will span over a duration of one hour and three hours respectively.</p>\r\n<p><strong>Rules and Regulations:</strong></p>\r\n<ol>\r\n<li>All the required materials will be provided.</li>\r\n<li>A team can have a maximum of 4 members.</li>\r\n<li>The event will consist of two rounds. First round is an aptitude test and second round is a designing challenge involving basic structural and earthquake principles.</li>\r\n<li>Teams can register for the event in prior or on the spot.</li>\r\n<li>Required material will be provided to the teams.</li>\r\n  <li>Duration:<br>Round 1: One hour.<br /> Round 2: Three hours</li>\r\n<li>The decision of judges and organisers would be final.</li>\r\n</ol>', 1, 4, '', 100, 'team', '8K', NULL, NULL, NULL, 'Akshay', '7012740515', 'Sreeeram', '8157024412', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'sthapati', '$2y$13$ugVbERuQAh2nGH5Q2Pe2m.tZ74m85ALW.Vo4w.d.s18/gCWR17J4q', 'sthapati', 1, ''),
(107, 4, 'CONTRIVIR', 'It\'s time to materialize your city with innovative design concepts and blow everyone\'s mind!', '<p>If you had ever dreamt of a city of your own, here is your perfect opportunity to exhibit it to the world. Hestia&rsquo;19 provides you with a platform to captivate everyone with your idea.</p>\r\n<p>It\'s time to materialize your city with innovative design concepts and blow everyone\'s mind!</p>\r\n<p><strong>Rules and Regulation:</strong></p>\r\n<ol>\r\n<li>Participants should submit the plan in any form, via hand drawing or computer draft (CADD), by uploading the link in \'My Events\' after registration.</li>\r\n<li>A person can participate alone or as a team with a maximum of four members.</li>\r\n<li>Plan copied directly from any internet source will not be valid.</li>\r\n<li>Each team should submit their design beforehand as well, by uploading the link in \'My Events\' after registration.</li>\r\n<li>Received plans will be evaluated and the selected team will have to further give a short presentation (15 minutes) about the plan.</li>\r\n<li>The best plan and it\'s description will be adjudged the winner.</li>\r\n<li>All decisions made by the judges will be final.</li>\r\n</ol>', 1, 4, 'Dynamics Lab', 100, 'team', '5K', 'Link to Plan', NULL, '2019-03-27', 'Sajna Aloysius', '7356210486', 'Seenu T Panicker', '8281446575', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'contrivir', '$2y$13$pY5IWWb2qPu4H6XdOHcrgukYQV5mpW5yPZGmvSnWZW7GrfBcmn6.G', 'contrivir', 1, ''),
(108, 4, 'INNOVATE', '\"Science has not yet taught us if madness is or is not the sublimity of the intelligence.\"', '<p>Hestia \'19 presents before you Innovate, a platform for those who know to combine their wit with knowledge and thoughts with intelligence. Innovate is ready with a cornucopia of polls to check your acumen.</p>\r\n<p>This quiz session is characterized by assorted rounds which covers almost everything under the sun, be it automobiles, celluloid, sports, books, entertainment and absolutely anything under the \"intelligence zone\" to sieve the brains among you and award the outstanding ones!</p>', 1, 2, '', 100, 'team', '5K', NULL, NULL, NULL, 'Mammen Vergis', '8547264552', 'Sreya Jose', '9605937414', 0, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'innovate', '$2y$13$Y0wKNfLZRU3DvAqLNRshW.Ays8lJFfiAuOHlnXOh07JUEs8Z00wD2', 'innovate', 1, ''),
(109, 16, 'PROJECT PLANNING MANAGEMENT USING PRIMAVERA', 'Managing projects driving you crazy? Poor planning making your projects go haywire?', '<p>In this ultra-competitive world, get ahead of the pack as Hestia\'19 brings to you a chance to harness the power of Primavera, the most efficient and intuitive project portfolio management software available today.</p>\r\n<p>Learn from the best in the business and master the advanced toolsets offered by Primavera to seamlessly plan, schedule and evaluate your projects with unparalleled control.&nbsp;</p>\r\n<p>\r\n  The workshop is open to all, but Civil Engineering students are preferred.</p>\r\n<p>\r\n  All participants should bring their own laptops.\r\n</p>\r\n<p>\r\n  The workshop will be followed by an online course.</p>\r\n<p>\r\n  Course completion certificate will be awarded worth 50 activity points.\r\n</p>\r\n<p>\r\n  Register now at www.hestia.live !\r\n</p>', 1, 1, '', 600, 'head', NULL, NULL, NULL, NULL, 'Hisana', '7559049208', 'Aswathy', '7356425171', 70, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'project_planning', '$2y$13$2gbZLclHoLjIMgC/ipx4/eWz/VHFy3RKNB.Da8T74RDAD71sMdsNy', 'project_planning', 0, ''),
(110, 9, 'Robo con-Robo expo', 'From Astroboy to R2-D2 and now Sophia, the humanoid that can think, as time passes by, robots have been evolving at a tremendous rate.', '<p>Grab your tools and get ready to present your very own robot to the world at Kerala\'s biggest Robotics Expo at Hestia\'19, the biggest Technocultural Fest in South India.</p>\r\n<p>Showcase your robots, whether big or small, and you might just be the lucky ones to bag the unbelievable prizes and an internship opportunity with Genrobotics!</p>\r\n<p>HESTIA \'19 presents to you the pinnacle of Artificial Intelligence, Robotics! Gather your friends and witness a mesmerizing array of projects at ROBO-CON. An exclusive internship opportunity is being offered to the best of the best at the expo. But, that\'s not it! ROBO-CON also offers you exciting events!</p>\r\n<p>Afterall, each perfect machine needs an equally imperfect you to make it operational!</p>', 1, 1, '', 100, 'head', NULL, NULL, NULL, NULL, 'Thomas', '9496800215', 'Abhishek', '8593803940', 0, '2019-03-15 00:00:00', '2019-03-30 00:00:00', 'robo_con', '$2y$13$LKyzoUxurLefLueC0XbJheDthwnSIbYPUWdVi0BF2EHHYrQijYIc.', 'robo_con', 0, ''),
(111, 16, 'Product designing workshop(wood based)', 'Focuses on understanding various wood crafting techniques -Physical modelling of a product and exploring it\'s possibilities.', '<p>Samvit Blass has over 13 years of experience in product design, having worked in China, USA and India. Born in Auroville and his works fuse concepts with international design approach. Founder of LIGHT-FISH studio in Auroville.</p>\r\n<p>Focuses on minimalistic beauty of natural materials which are chosen and crafted into visionary and intelligently designed products.</p>', 1, 1, '', 250, 'head', NULL, NULL, NULL, NULL, 'Gayathri Menon', '8129270215', 'Gayathri.S', '8547285419', 15, '2019-03-15 00:00:00', '2019-03-29 00:00:00', 'product_design', '$2y$10$.mbhxEC4uFHaBG2ii2v0hOHg7PNKJQYPB/v0SfYtB5RkCgTaEjA8q', 'product_design', 1, ''),
(112, 20, 'accommodation', 'accommodation', 'accommodation', 1, 1, '', 0, 'head', NULL, NULL, NULL, NULL, 'accommodation', 'accommodation', 'accommodation', 'accommodation', 0, '2019-03-15 00:00:00', '2019-03-31 00:00:00', 'accommodation', 'accommodation', 'accommodation', 0, ''),
(113, 18, 'Cybersecurity: Challenges and Opportunities', 'Talk by Mr. Sreenath Sasikumar', '<p>Mr. Sreenath Sasikumar is an Electronics and Communication engineer and the Deputy Commander of Kerala Police Cyberdome. Having a wide array of accomplishments, his contributions to OWASP have been pioneering. Mr. Sreenath has featured in the Google \'Hall of Fame\' and his reviews on technically advanced books are just simply brilliant.</p>\r\n<p>Hestia &rsquo;19, the techno-managerial cultural fest of TKMCE, in association with IEEE SB TKMCE, is proud to present Mr. Sreenath Sasikumar to speak on the topic Cybersecurity: Challenges and Opportunities on 29th March.</p>', 1, 1, 'PTA Hall', 50, 'head', NULL, NULL, NULL, NULL, 'Akhilesh K', '9539498696', 'Namitha S', '7907421802', 60, '2019-03-15 00:00:00', '2019-03-28 00:00:00', 'cyber_security', '$2y$10$sTwzugHa5B7LyXJ8rgTp0.2HdezMKuB4bj0TDq.FhkzEC1AezwxUi', 'cyber_security', 1, ''),
